INSERT INTO `table_dacdiem_noibat` VALUES (68,'9936497212165101.jpg',1,1,526,'9936497212165101_470x269.270833333.jpg',NULL,NULL,'Camera tuyệt đỉnh',' Với phím Home được tích hợp cảm biến vân tay, Galaxy J7 Prime là một trong những thiết bị tầm trung hiếm hoi được hãng trang bị công nghệ hiện đại này, cho khả năng bảo mật tối ưu và vo cùng tiện lợi. '),(69,'452917503148775.jpg',1,1,526,'452917503148775_470x284.447916667.jpg',NULL,NULL,'Thiết kế hoàn hảo ','Samsung Galaxy J7 Prime có camera chính độ phân giải 13 MP kèm đèn flash LED, tốc lấy nét và có tốc độ chụp nhanh, cho chất lượng ảnh khá tốt trong tầm giá, đặc biệt chất lượng ảnh chụp đêm đỉnh cao với khẩu độ f/1.9. Camera trước độ phân giải 8 MP cũng mang khẩu độ f/1.9 mang lại những tấm ảnh selfie chất lượng hơn trong điều kiện thiếu sáng. Selfie cũng chất hơn với tính năng làm đẹp hoàn mĩ, Selfie cảm ứng bàn tay, Selfie góc rộng… được tích hợp sẵn. '),(70,'4703830158498921.jpg',1,1,525,'4703830158498921_285x285.jpg',NULL,NULL,'Thiết kế kim loại nguyên khối','iPhone 6 Plus mang trên mình một màn hình lớn đến 5,5 inch nhưng bạn vẫn có thể dễ dàng cầm máy gọn gàng đầy thoải mái nhờ việc bo tròn góc cạnh của máy. Phần khung nhôm nguyên khối thống nhất tạo nên sự liền lạc của mặt kính và bộ khung kim loại, tất cả đều được gia công tỉ mỉ đến từng chi tiết nhỏ để nâng cao trải nghiệm của bạn. Thiết kế lớn hơn, đẹp hơn và trên hết là độ mỏng chỉ 7 mm - mỏng nhất so với những máy cùng kích thước màn hình, mang đến một sản phẩm vô cùng sang trọng, cao cấp.');
