uacute;ng t&ocirc;i x&acirc;y dựng c&aacute;c nguy&ecirc;n tắc l&agrave;m kim chỉ nam hoạt động cho tổ chức của m&igrave;nh</p>\r\n<ul>\r\n<li>Củng cố v&agrave; ph&aacute;t triển mối quan hệ hợp t&aacute;c với kh&aacute;ch h&agrave;ng v&agrave; c&aacute;c b&ecirc;n li&ecirc;n quan</li>\r\n<li>Am hiểu về những lĩnh vực m&agrave; c&ocirc;ng ty đang kinh doanh</li>\r\n<li>&Aacute;p dụng nguy&ecirc;n tắc quản l&yacute; nh&oacute;m cho tất cả c&aacute;c ph&ograve;ng ban</li>\r\n<li>Khuyến kh&iacute;ch x&acirc;y dựng hệ thống quản l&yacute; cho từng bộ phận</li>\r\n<li>X&uacute;c tiến mối quan hệ hợp t&aacute;c giữa c&aacute;c ph&ograve;ng ban trong c&ocirc;ng ty</li>\r\n<li>Động vi&ecirc;n tinh thần l&agrave;m việc của nh&acirc;n vi&ecirc;n th&ocirc;ng qua c&aacute;c chương tr&igrave;nh ph&aacute;t triển nghề nghiệp</li>\r\n<li>T&aacute;i đầu tư phần lớn lợi nhuận</li>\r\n</ul>\r\n<p>Lu&ocirc;n đặt kh&aacute;ch h&agrave;ng trong trọng t&acirc;m suy nghĩ của m&igrave;nh, hoạt động nhằm đem lại những gi&aacute; trị tốt đẹp nhất phục vụ cho kh&aacute;ch h&agrave;ng. Đ&oacute; l&agrave; gi&aacute; trị m&agrave; ch&uacute;ng t&ocirc;i theo đuổi v&agrave; định hướng cho đội ngũ nh&acirc;n vi&ecirc;n của m&igrave;nh</p>',0,''),(7,9,'Mục tiêu phát triển','muc-tieu-phat-trien','','',2,1,1484780125,1484791190,'','','',NULL,'<p>C&ocirc;ng Ty TNHH Ph&acirc;n B&oacute;n Golhar - Golhar Co.,ltd c&oacute; địa chỉ tại L&ocirc; H6-H7-H8, Đường số 05, KCN Đức H&ograve;a III- Hồng Đạt - X&atilde; Đức Lập Hạ - Huyện Đức Ho&agrave; - Long An.&nbsp;<br />M&atilde; số thuế 1101833190 Đăng k&yacute; &amp; quản l&yacute; bởi Cục Thuế Tỉnh Long An<br />Ng&agrave;nh nghề kinh doanh ch&iacute;nh: Sản xuất ph&acirc;n b&oacute;n v&agrave; hợp chất ni tơ</p>\r\n<p>Ở khu vực Đ&ocirc;ng Nam &Aacute;, Ch&uacute;ng t&ocirc;i tự h&agrave;o đ&oacute;ng g&oacute;p quan trong trong sự tăng trưởng v&agrave; bền vững của ng&agrave;nh n&ocirc;ng nghiệp Malaysia trong hơn 50 năm, v&agrave; ph&aacute;t triển thị t