INSERT INTO `table_product2` VALUES (46,3,0,0,1415929007,0,'551430853070.jpg','551430853070_142.92156862745x185.jpg','Motor cửa cuốn ','','motor-cua-cuon',0,'','','','','','','<p><strong><span style=\"text-decoration: underline;\"><span style=\"font-size: large; color: #00ff00;\">Cửa cuốn - Nhật Đức Ph&aacute;t</span></span></strong></p>\r\n<p><span style=\"font-size: medium;\">Động cơ - Moter - Bộ tời</span></p>\r\n<p><span style=\"font-size: medium;\">Trọng tải ph&ugrave; hợp với từng loại k&iacute;ch thước v&agrave; cửa. Gồm c&aacute;c loại cơ bản tương đương trọng tải.</span></p>\r\n<p><span style=\"font-size: medium;\"><strong>Chi tiết kỹ thuật:</strong></span></p>\r\n<div><span style=\"font-size: medium;\">- Motor &nbsp;được sản xuất theo c&ocirc;ng nghệ Đ&agrave;i Loan</span></div>\r\n<div><span style=\"font-size: medium;\">- Th&iacute;ch hợp cho tất cả c&aacute;c loại cửa cuốn.</span></div>\r\n<div><span style=\"font-size: medium;\">- Kết nối dễ d&agrave;ng với c&aacute;c thiết bị kh&aacute;c: Bộ tự ngắt, bộ đảo chiều, c&ograve;i b&aacute;o động</span></div>\r\n<div><span style=\"font-size: medium;\">- Điều khiển từ xa hoặc n&uacute;t &acirc;m tường: hiệu quả, ch&iacute;nh x&aacute;c, an to&agrave;n</span></div>\r\n<div><span style=\"font-size: medium;\">- Lắp đặt b&ecirc;n ngo&agrave;i l&ocirc; cuốn, n&ecirc;n dễ d&agrave;ng cho việc sửa chữa</span></div>\r\n<div><span style=\"font-size: medium;\">- M&ocirc;tơ AC, DC sử dụng điện xoay chiều 220V, hoặc d&ograve;ng điện một chiều DC rất ph&ugrave; hợp cho c&aacute;c loại cửa cuốn tự động th&ocirc;ng thường.</span></div>\r\n<div><span style=\"font-size: medium;\">- Trong trường hợp mất điện c&oacute; thể d&ugrave;ng d&acirc;y x&iacute;ch để k&eacute;o cửa. Sử dụng từ 3-4 rơle ngắt Cam để tăng t&iacute;nh an to&agrave;n</span></div>\r\n<div><span style=\"font-size: medium;\">- Ứng dụng: D&ugrave;ng cho cửa đi cho c&aacute;c văn ph&ograve;ng, nh&agrave; ở, nh&agrave; xưởng, nh&agrave; kho&hellip;..&nbsp;</span></div>\r\n<div><span style=\"font-size: medium;\">được sản xuất theo ti&ecirc;u chuẩn ISO 9000/9001/9004/19011:2000&nbsp;</span></div>\r\n<div><span style=\"font-size: medium;\">&nbsp;</span></div>\r\n<div><span style=\"font-size: medium;\">- Bảo h&agrave;nh tận nơi : 18 Th&aacute;ng.</span></div>\r\n<p><span style=\"font-size: medium;\">Moter 300KG,Moter 400KG,&nbsp;Moter 500KG,&nbsp;Moter 600KG,&nbsp;Moter 800KG,&nbsp;Moter 1.000KG,&nbsp;Moter 1.200KG.</span></p>',1,1,1415929004,1417180980,398,'',0,'','','','','','','551430853070_220.17647058824x285.jpg'),(47,3,0,0,1416223057,0,'922331651225.png','922331651225_215x165.13715710723.png','Moter cửa cuốn','','moter-cua-cuon',0,'','','','','','','<p><span style=\"text-decoration: underline; color: #00ff00; font-size: large;\"><strong>Cửa cuốn - Nhật Đức Ph&aacute;t</strong></span></p>\r\n<p><span style=\"font-size: medium;\">Động cơ - Moter - Bộ tời</span></p>\r\n<p><span style=\"font-size: medium;\">Trọng tải ph&ugrave; hợp với từng loại k&iacute;ch thước v&agrave; cửa. Gồm c&aacute;c loại cơ bản tương đương trọng tải.</span></p>\r\n<p><span style=\"font-size: medium;\"><strong>Chi tiết kỹ thuật:</strong></span></p>\r\n<div><span style=\"font-size: medium;\">- Motor &nbsp;được sản xuất theo c&ocirc;ng nghệ Đ&agrave;i Loan</span></div>\r\n<div><span style=\"font-size: medium;\">- Th&iacute;ch hợp cho tất cả c&aacute;c loại cửa cuốn.</span></div>\r\n<div><span style=\"font-size: medium;\">- Kết nối dễ d&agrave;ng với c&aacute;c thiết bị kh&aacute;c: Bộ tự ngắt, bộ đảo chiều, c&ograve;i b&aacute;o động</span></div>\r\n<div><span style=\"font-size: medium;\">- Điều khiển từ xa hoặc n&uacute;t &acirc;m tường: hiệu quả, ch&iacute;nh x&aacute;c, an to&agrave;n</span></div>\r\n<div><span style=\"font-size: medium;\">- Lắp đặt b&ecirc;n ngo&agrave;i l&ocirc; cuốn, n&ecirc;n dễ d&agrave;ng cho việc sửa chữa</span></div>\r\n<div><span style=\"font-size: medium;\">- M&ocirc;tơ AC, DC sử dụng điện xoay chiều 220V, hoặc d&ograve;ng 