INSERT INTO `table_tinloai1_1` VALUES (2,14,0,'Giảm 30% giá bán bộ phụ kiện đi cùng iPhone 7/7 Plus','giam-30-gia-ban-bo-phu-kien-di-cung-iphone-77-plus','Từ nay đến hết ngày 30/11, FPT Shop giảm ngay 30% giá bán bộ phụ kiện tiện ích khi mua kèm iPhone 7/7 Plus. Bên cạnh đó, bạn còn được giảm 40% khi đến FPT Shop đổi mới phụ kiện                            ','<h3><strong>Giảm 30% bộ phụ kiện cho iPhone 7/ 7 Plus</strong></h3>\r\n<p>Ch&agrave;o đ&oacute;n iPhone 7/ 7 Plus đến với ng&ocirc;i nh&agrave; chung, FPT Shop giảm ngay 30% gi&aacute; b&aacute;n combo&nbsp;<a href=\"http://fptshop.com.vn/phu-kien\" target=\"_blank\">phụ kiện ch&iacute;nh h&atilde;ng</a>&nbsp;d&agrave;nh cho si&ecirc;u phẩm n&agrave;y bao gồm: ốp lưng/bao da, k&iacute;nh cường lực v&agrave; sạc dự ph&ograve;ng Maxco.</p>\r\n<p>Đồng thời, FPT Shop cũng giảm 38% gi&aacute; b&aacute;n 2 bộ combo<a href=\"http://fptshop.com.vn/phu-kien\" target=\"_blank\">&nbsp;phụ kiện tiện &iacute;ch</a>&nbsp;được c&aacute;c bạn t&igrave;m mua nhiều nhất trong thời gian qua:</p>\r\n<ul>\r\n<li>Combo Silver: Thẻ nhớ Sandisk 8GB, sạc dự ph&ograve;ng Yoobao 6.000mAh v&agrave; gậy selfie mini, tất cả chỉ 499.000 đồng, tiết kiệm 259.000 đồng so với gi&aacute; gốc.</li>\r\n<li>Combo Diamond: Loa Bluetooth Remax M1, thẻ nhớ dung lượng 16GB v&agrave; sạc dự ph&ograve;ng Yoobao 6.000mAh, tất cả chỉ 799.000 đồng, tiết kiệm tận 498.000 đồng so với khi mua lẻ từng m&oacute;n phụ kiện</li>\r\n</ul>\r\n<p>Kh&ocirc;ng k&eacute;m phần hấp dẫn, FPT Shop cũng tung ra bộ sưu tập&nbsp;<a href=\"http://fptshop.com.vn/phu-kien\" target=\"_blank\">ốp lưng thiết kế</a>&nbsp;d&agrave;nh cho si&ecirc;u phẩm iPhone 7/ 7 Plus với gi&aacute; &ldquo;hạt dẻ&rdquo; chỉ từ 150.000 đồng. Những chiếc ốp lưng độc đ&aacute;o n&agrave;y kh&ocirc;ng chỉ l&agrave; m&oacute;n phụ kiện để bảo vệ m&aacute;y m&agrave; c&ograve;n l&agrave; m&oacute;n phụ kiện thời trang, n&oacute;i l&ecirc;n c&aacute; t&iacute;nh v&agrave; phong c&aacute;ch của chủ nh&acirc;n.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/iP7.png\" alt=\"phụ kiện\" /></p>\r\n<p><em>&ldquo;Bộ 3 quyền lực&rdquo; hỗ trợ đắc lực cho si&ecirc;u phẩm iPhone 7/ 7 Plus đang được giảm 30% tại FPT Shop</em></p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Đến FPT Shop l&ecirc;n đời phụ kiện được giảm đến 40%</strong></h3>\r\n<p>Đ&aacute;p lại sự ủng hộ của tất cả kh&aacute;ch h&agrave;ng, FPT Shop sẽ &aacute;p dụng ưu đ&atilde;i giảm gi&aacute; đến 40% cho kh&aacute;ch h&agrave;ng đến đổi mới ốp lưng của c&aacute;c d&ograve;ng điện thoại: OPPO A37, Galaxy Note 5, Galaxy J1 Mini, Galaxy J1 2016, Galaxy J5 2015,&hellip;Cụ thể, khi mang c&aacute;c ốp lưng cũ của c&aacute;c d&ograve;ng điện thoại n&agrave;y đến FPT Shop đổi lấy ốp lưng mới bạn sẽ được giảm đến 40% gi&aacute; b&aacute;n của sản phẩm mới. Đ&acirc;y l&agrave; dịp thuận tiện để bạn thay &aacute;o mới cho dế y&ecirc;u của m&igrave;nh.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/FPT_Shop_KMT3_%20(17).jpg\" alt=\"phụ kiện\" /></p>\r\n<p><em>Bạn được giảm ngay đến 40% khi đến FPT Shop đổi mới ốp lưng cho nhiều d&ograve;ng m&aacute;y nổi bật</em></p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Phụ kiện mua 1 tặng 1</strong></h3>\r\n<p>Dịp n&agrave;y, FPT Shop sẽ tặng ngay loa Bluetooth Rocky trị gi&aacute; 750.000 đồng cho tất cả kh&aacute;ch h&agrave;ng chọn mua c&aacute;c mẫu&nbsp;<a href=\"http://fptshop.com.vn/phu-kien\" target=\"_blank\">sạc dự ph&ograve;ng</a>&nbsp;đang được ưa chuộng nhất hiện nay như: Yoobao 20.000mAh, Prolink 1.500mAh, iHave/Maxco 5000mAh, 6000mAh.</p>\r\n<p>C&aacute;c loại sạc dự ph&ograve;ng m&agrave; FPT Shop cung cấp đến từ c&aacute;c thương hiệu quốc tế như iHave, Yoobao, Maxco,&hellip;với thiết kế gọn đẹp dễ d&agrave;ng mang theo b&ecirc;n người. Dung lượng pin đủ, điện &aacute;p hoạt động ổn định v&agrave; tự ngắt khi thiết bị được sạc đầy. B&ecirc;n cạnh đ&oacute;, c&aacute;c loại sạc dự ph&ograve;ng n&agrave;y đều c&oacute; bảo hiểm ch&aacute;y nổ, đảm bảo an to&agrave;n cho người d&ugrave;ng ngay cả khi sản phẩm bị rơi hoặc va đập.</p>\r\n<p>B&ecirc;n cạnh đ&oacute;, chọn mua sản phẩm chuột kh&ocirc;ng d&acirc;y tại FPT Shop, bạn cũng được tặng ngay chuột d&acirc;y r&uacute;t trị gi&aacute; 119.000 đồng.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/loa-01.png\" alt=\"phụ kiện\" /></p>\r\n<p><em>Tặng ngay loa nấm si&ecirc;u đ&aacute;ng y&ecirc;u&nbsp;khi bạn chọn mua sạc dự ph&ograve;ng iHave, Maxco, Prolink, Yoobao tại FPT Shop</em></p>\r\n<p>&nbsp;</p>\r\n<p>Mang kho giải tr&iacute; khổng lồ đến ng&ocirc;i nh&agrave; bạn chỉ với 2.190.000 đồng v&agrave; kh&ocirc;ng cần tốn th&ecirc;m ph&iacute; h&agrave;ng th&aacute;ng,&nbsp;<a href=\"http://fptshop.com.vn/phu-kien/fpt-play-box\" target=\"_blank\">FPT Play Box</a>&nbsp;đ&atilde; dần trở th&agrave;nh thiết bị nhỏ gọn kh&ocirc;ng thể thiếu của c&aacute;c gia đ&igrave;nh. Chọn sở hữu sản phẩm n&agrave;y tại FPT Shop, bạn sẽ được sử dụng thử trong v&ograve;ng 31 ng&agrave;y.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/IMG_0500%20(Copy)(2).jpg\" alt=\"phụ kiện\" /></p>\r\n<p><em>FPT Play Box, thế giới giải tr&iacute; trong tầm tay, đến FPT Shop mua ngay</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sản phẩm mua tại FPT Shop l&agrave; h&agrave;ng ch&iacute;nh h&atilde;ng, được đổi trả miễn ph&iacute; trong 30 ng&agrave;y,&nbsp;</strong><strong>bạn c&oacute; thể đến mua trực tiếp tại&nbsp;<a href=\"http://fptshop.com.vn/cua-hang\" target=\"_blank\">cửa h&agrave;ng</a>,&nbsp;</strong><strong>chọn mua&nbsp;<a href=\"http://fptshop.com.vn/phu-kien\" target=\"_blank\">online</a>&nbsp;</strong><strong>hoặc gọi hotline 1800 6601 để được tư vấn, mua h&agrave;ng nhan</strong><strong>h</strong></p>\r\n<p>&nbsp;</p>','118577714082.jpg','118577714082_710x475.jpg',1,1,'','','','','','',25,'Chủ nhật, 13/11/2016 10:13:35',42),(25,3,0,'Địa chỉ mua laptop chính hãng giá rẻ được nhiều bạn trẻ săn lùng','dia-chi-mua-laptop-chinh-hang-gia-re-duoc-nhieu-ban-tre-san-lung','Không những bạn được mua laptop chính hãng với mức giá rẻ mà còn được sở hữu dễ dàng nhất với ưu đãi trả góp 0% lãi suất hoặc trả góp 0 đồng khi đến với FPT Shop                ','<p>Th&aacute;ng 11 n&agrave;y, FPT Shop sẽ tiếp tục bổ sung nhiều mẫu&nbsp;<a href=\"http://fptshop.com.vn/may-tinh-xach-tay\" target=\"_blank\">laptop độc quyền</a>&nbsp;sở hữu cấu h&igrave;nh đa dạng, thiết kế tinh tế từ c&aacute;c thương hiệu h&agrave;ng đầu như Dell, HP, Asus, Lenovo,&hellip;với gi&aacute; b&aacute;n chỉ từ 4.990.000 đồng.</p>\r\n<p>Đi đ&ocirc;i với sự đa dạng sản phẩm v&agrave; đảm bảo gi&aacute; b&aacute;n tốt, FPT Shop c&ograve;n mở rộng hơn cơ hội sở hữu ngay<a href=\"http://fptshop.com.vn/may-tinh-xach-tay\" target=\"_blank\">&nbsp;laptop</a>mới cho tất cả kh&aacute;ch h&agrave;ng qua ưu đ&atilde;i mua trả g&oacute;p 0% l&atilde;i suất hoặc kh&ocirc;ng cần trả trước, cụ thể:</p>\r\n<ul>\r\n<li><em>Trả g&oacute;p 0% l&atilde;i suất &aacute;p dụng cho c&aacute;c sản</em>&nbsp;phẩm: HP Pavillion 14-ab119TU, HP Pavillion 15-ab223TU, Dell Vostro V5459, Dell Vostro V5568, Asus TP501UA-DN094T, Asus TP301UA-DW260T, Asus A556UR-DM094D, Asus GL552VX-DM310D.</li>\r\n<li><em>Trả g&oacute;p kh&ocirc;ng cần trả trước &aacute;p dụng cho c&aacute;c sản phẩm nổi bật như:</em>&nbsp;Dell Ins N3558G, Asus X540LJ-XX316D, Asus X455LA-WX470D, Asus X540SC-XX040D, Asus E502SA-XX070D, Asus E402SA-WX134D, Asus E200HA-FD0043TS, Lenovo IdeaPad 100-14IBD</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Như vậy, với 2 ưu đ&atilde;i trả g&oacute;p nổi bật n&agrave;y bạn vừa c&oacute; thể dễ d&agrave;ng t&igrave;m được chiếc laptop ph&ugrave; hợp với nhu cầu sử dụng, vừa c&oacute; thể gạt bớt những đắn đo về vấn đề t&agrave;i ch&iacute;nh để sở hữu ngay sản phẩm mới tại FPT Shop.</p>\r\n<p>Kh&ocirc;ng k&eacute;m phần hấp dẫn, bạn c&ograve;n được tặng ngay phiếu mua h&agrave;ng trị gi&aacute; 150.000 đồng khi chọn mua laptop c&oacute; gi&aacute; từ 5.000.000 đồng.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/IMG_9971%20(Copy).jpg\" alt=\"laptop\" /></p>\r\n<h3><em>Chọn mua laptop tại FPT Shop, bạn kh&ocirc;ng những được sở hữu với gi&aacute; rẻ m&agrave; c&ograve;n được ưu đ&atilde;i trả g&oacute;p 0% l&atilde;i suất hoặc kh&ocirc;ng cần trả trước.</em></h3>\r\n<p>&nbsp;</p>\r\n<h3><strong>Đ&oacute;n cơn mưa qu&agrave; tặng c&ugrave;ng Asus v&agrave; Lenovo</strong></h3>\r\n<p>Dịp n&agrave;y, chọn mua bộ ba laptop Asus Zenbook 3 bạn được tặng ngay phiếu mua h&agrave;ng trị gi&aacute; 500.000 đồng. Đồng thời, bạn c&ograve;n được nhận bộ qu&agrave; tiện &iacute;ch v&agrave; gi&aacute; trị bao gồm: Chuột Wireless Logitech MX Anywhere 2 trị gi&aacute; 1.990.000 đồng, t&uacute;i cao cấp ASUS Carry Bag v&agrave; Mini-dock gồm 3 cổng (USB Type A/ USB Type C/ HDMI).</p>\r\n<p>Kh&ocirc;ng k&eacute;m phần hấp dẫn, FPT Shop cũng giảm ngay 500.000 đồng cho laptop Lenovo E560 v&agrave; 400.000 đồng cho Lenovo E460, gi&aacute; chỉ c&ograve;n lần lượt l&agrave; 15.490.000 đồng v&agrave; 14.590.000 đồng. B&ecirc;n cạnh đ&oacute;, chọn mua bộ đ&ocirc;i laptop n&agrave;y, bạn c&ograve;n được nhận ngay balo tiện dụng.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/Lenovo-11.jpg\" alt=\"laptop\" /><em>Bộ đ&ocirc;i Lenovo E460 v&agrave; E560 được giảm đến 500.000 đồng v&agrave; th&ecirc;m qu&agrave; tặng thiết thực tại FPT Shop</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sản phẩm mua tại FPT Shop l&agrave; h&agrave;ng ch&iacute;nh h&atilde;ng, được đổi trả miễn ph&iacute; trong 30 ng&agrave;y,&nbsp;</strong><strong>bạn c&oacute; thể chọn chọn&nbsp;</strong><a href=\"http://fptshop.com.vn/cua-hang\">cửa hàng</a><strong>&nbsp;g&acirc;̀n nh&acirc;́t hoặc chọn&nbsp;</strong><a href=\"http://fptshop.com.vn/may-tinh-xach-tay\" target=\"_blank\">mua online</a>&nbsp;<strong>hoặc gọi hotline 1800 6601 để được tư vấn, mua h&agrave;ng nhanh.</strong></p>','482356458125.JPG','482356458125_710x475.jpg',1,1,'','','','','','',23,'Chủ nhật, 13/11/2016 10:13:38',15),(26,3,0,'Cơ hội sở hữu smartphone Coolpad với giá rẻ hơn đến 3 triệu đồng tại FPT Shop','co-hoi-so-huu-smartphone-coolpad-voi-gia-re-hon-den-3-trieu-dong-tai-fpt-shop','Trong tháng 11 này, FPT Shop tặng 300 phiếu mua hàng trị giá đến 3 triệu đồng cho các khách hàng chọn mua smartphone Coolpad. Bên cạnh đó, bạn còn được tặng bộ quà tiện ích, trả góp 0% lãi suất và không cần trả trước khi chọn mua một số sản phẩm nổi bật.                ','<p>Theo đ&oacute;, từ nay đến hết ng&agrave;y 30/11, chọn mua smartphone Coolpad tại&nbsp;<a href=\"http://fptshop.com.vn/\">FPT Shop</a>, bạn c&oacute; ngay cơ hội tr&uacute;ng phiếu mua h&agrave;ng trị gi&aacute; đến 3.000.000 đồng v&agrave; được trừ thẳng v&agrave;o gi&aacute; b&aacute;n. Như vậy, bạn sẽ c&oacute; cơ hội sở hữu sản phẩm với gi&aacute; đặc biệt, thấp hơn tận 3.000.000 đồng so với gi&aacute; b&aacute;n hiện h&agrave;nh.</p>\r\n<p>Kh&ocirc;ng k&eacute;m phần hấp dẫn, chọn mua c&aacute;c mẫu smartphone nổi bật của Coolpad bao gồm&nbsp;<a href=\"http://fptshop.com.vn/dien-thoai/coolpad-sky-3\">Sky 3</a>,&nbsp;<a href=\"http://fptshop.com.vn/dien-thoai/coolpad-sky-3pro\">Sky 3 Pro</a>,&nbsp;<a href=\"http://fptshop.com.vn/dien-thoai/coolpad-max-lite?utm_source=PUBLISHERS&amp;utm_campaign=KMT11&amp;utm_medium=BAIVIET&amp;utm_content=MAXLITE&amp;utm_term=KENH14\">Max Lite</a>&nbsp;bạn kh&ocirc;ng những kh&ocirc;ng cần trả trước bất kỳ khoản n&agrave;o m&agrave; c&ograve;n được hưởng 0% l&atilde;i suất trong suốt thời gian trả g&oacute;p. Hoặc bạn cũng c&oacute; thể chọn nhận ngay bộ qu&agrave; 5 m&oacute;n phụ kiện: gậy selfie, cặp loa c&oacute; d&acirc;y, c&aacute;p OTG, đế ốp tựa lưng v&agrave; chốt chống bụi. Đ&acirc;y l&agrave; những m&oacute;n phụ kiện v&ocirc; c&ugrave;ng thiết thực v&agrave; tiện &iacute;ch, hỗ trợ tốt hơn cho chiếc smartphone của bạn.</p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\"><img src=\"http://fptshop.com.vn/Uploads/images/2015/1(63).png\" alt=\"\" /></p>\r\n<p align=\"center\"><em>Chọn mua smartphone Coolpad tại FPT Shop bạn c&oacute; ngay ưu đ&atilde;i trả g&oacute;p 0% l&atilde;i suất v&agrave; kh&ocirc;ng cần trả trước hoặc được tặng bộ qu&agrave; s&agrave;nh điệu.</em></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p><strong>Điểm qua c&aacute;c mẫu smartphone nổi bật của Coolpad</strong></p>\r\n<p><strong>Coolpad SKY 3</strong>&nbsp;c&oacute; gi&aacute; b&aacute;n 3.490.000 đồng, l&agrave; mẫu smartphone hỗ trợ selfie chuy&ecirc;n nghiệp với camera trước c&oacute; độ ph&acirc;n giải 8MP c&ugrave;ng thiết kế hiện đại với độ mỏng ấn tượng chỉ 7,85mm, 2 phi&ecirc;n bản m&agrave;u l&agrave; v&agrave;ng đồng v&agrave; trắng viền v&agrave;ng.</p>\r\n<p><a href=\"http://fptshop.com.vn/dien-thoai/coolpad-sky-3\">SKY 3</a>&nbsp;được trang bị m&agrave;n h&igrave;nh lớn 5,5 inch, c&ocirc;ng nghệ IPS, độ ph&acirc;n giải HD kết hợp k&iacute;nh cường lực c&oacute; cạnh viền mỏng v&agrave; cong 2,5D gi&uacute;p h&igrave;nh ảnh hiển thị nổi bật v&agrave; sắc n&eacute;t. M&aacute;y sở hữu cấu h&igrave;nh tầm trung với vi xử l&yacute; 4 nh&acirc;n, RAM 2GB, bộ nhớ trong 16GB hoạt động tr&ecirc;n nền hệ điều h&agrave;nh Android Marshmallow 6.0. Đặc biệt,&nbsp;<a href=\"http://fptshop.com.vn/dien-thoai/coolpad-sky-3\">Coolpad SKY 3</a>&nbsp;l&agrave; sản phẩm đầu ti&ecirc;n tr&ecirc;n thị trường t&iacute;ch hợp t&iacute;nh năng quay phim m&agrave;n h&igrave;nh c&oacute; thu &acirc;m trực tiếp. Bộ đ&ocirc;i camera trước v&agrave; sau đều c&oacute; độ ph&acirc;n giải 8MP cho chất lượng ảnh chụp của 2 camera gần như tương đương nhau. B&ecirc;n cạnh đ&oacute;, camera sau c&ograve;n sở hữu t&iacute;nh năng chụp ảnh kh&ocirc;ng cần mở m&aacute;y, chỉ cần nhấn li&ecirc;n tục 2 lần v&agrave;o ph&iacute;m &acirc;m lượng xuống ở cạnh tr&aacute;i để k&iacute;ch hoạt. Trong khi đ&oacute;, camera trước với độ ph&acirc;n giải cao, g&oacute;c chụp rộng c&ugrave;ng c&aacute;c t&iacute;nh năng l&agrave;m đẹp sẽ cho bạn những bức ảnh selfie lung linh.</p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p><img src=\"http://fptshop.com.vn/Uploads/images/2015/2(118).jpg\" alt=\"\" /></p>\r\n<p align=\"center\"><em>Coolpad Sky 3 l&agrave; mẫu smartphone hỗ trợ selfie chuy&ecirc;n nghiệp với thiết kế tinh tế.</em></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p><strong>Coolpad Max Lite</strong>&nbsp;l&agrave; phi&ecirc;n bản thu gọn của&nbsp;<a href=\"http://fptshop.com.vn/dien-thoai/coolpad-max-lite\">Coolpad Max</a>, c&oacute; gi&aacute; b&aacute;n 4.999.000 đồng với 2 m&agrave;u trắng v&agrave; hồng. Đ&acirc;y l&agrave; chiếc smartphone tầm trung c&oacute; sở hữu sạc nhanh v&agrave; cảm biến v&acirc;n tay si&ecirc;u nhạy. M&aacute;y c&oacute; thiết kế nguy&ecirc;n khối chắc chắn, lớp vỏ l&agrave;m từ nhựa s&aacute;ng b&oacute;ng gần như mặt gương tr&ocirc;ng rất bắt mắt, m&agrave;n h&igrave;nh 5,5 inch chuẩn HD. M&aacute;y sở hữu chip Snapdragon 415, MSM 8929 8 nh&acirc;n xung nhịp 1,4 GHz, RAM 3GB. Bộ đ&ocirc;i camera c&oacute; độ ph&acirc;n giải 13MP &ndash; 5MP, 2 SIM 2 s&oacute;ng, c&oacute; hỗ trọ 4G LTE.</p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\"><img src=\"http://fptshop.com.vn/Uploads/images/2015/3(102).jpg\" alt=\"\" /></p>\r\n<p align=\"center\"><em>Coolpad Max Lite l&agrave; chiếc smartphone tầm trung sở hữu sạc nhanh v&agrave; cảm biến v&acirc;n tay si&ecirc;u nhạy</em></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p><strong>Coolpad Fancy</strong>&nbsp;nổi bật ngay từ vẻ ngo&agrave;i bởi thiết kế thanh mảnh v&agrave; gọn g&agrave;ng. Ở b&ecirc;n trong chiếc điện thoại n&agrave;y được trang bị con chip Snapdragon 410 mạnh mẽ, c&ugrave;ng dung lượng RAM l&ecirc;n đến 2GB hứa hẹn mang đến những trải nghiệm nhanh ch&oacute;ng v&agrave; mượt m&agrave; cho người d&ugrave;ng. Camera trước c&oacute; độ ph&acirc;n giải 8MP, camera trước 5MP với chế độ l&agrave;m đẹp Beauty sẽ l&agrave; c&ocirc;ng cụ hỗ trợ tuyệt vời cho việc chụp ảnh &ldquo;tự sướng&rdquo;. M&aacute;y được trang bị ứng dụng điều khiển hồng ngoại cho ph&eacute;p bạn c&oacute; thể điều khiển từ xa TV, m&aacute;y lạnh, quạt, DVD, m&aacute;y chiếu,...Với ph&iacute;m Cool Key độc đ&aacute;o nằm&nbsp;ở mặt sau của m&aacute;y, bạn dễ d&agrave;ng đ&aacute;nh thức m&agrave;n h&igrave;nh, gọi điện nhanh, nghe/nhận cuộc gọi hay, chụp ảnh nhanh hay mở một ứng dụng trực tiếp một c&aacute;ch nhanh ch&oacute;ng.</p>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><img src=\"http://fptshop.com.vn/Uploads/images/2015/4(63).jpg\" alt=\"\" /></p>\r\n<p align=\"center\"><em>Coolpad Sky 3 Pro, bản n&acirc;ng cấp đ&aacute;ng gi&aacute; của Sky 3 sẽ được b&aacute;n độc quyền tại FPT Shop với gi&aacute; 3.990.000 đồng trong tth&aacute;ng 11 n&agrave;y</em></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p><strong>Sản phẩm mua tại&nbsp;<a href=\"http://fptshop.com.vn/\">FPT Shop</a>&nbsp;l&agrave; h&agrave;ng ch&iacute;nh h&atilde;ng, được đổi trả miễn ph&iacute; trong 30 ng&agrave;y, bạn c&oacute; thể chọn chọn cửa hàng g&acirc;̀n nh&acirc;́t&nbsp;<a href=\"http://fptshop.com.vn/cua-hang\">tại đ&acirc;y</a>&nbsp;</strong><strong>hoặc chọn</strong>&nbsp;&nbsp;<strong>hoặc gọi hotline 1800 6601 để được tư vấn, mua h&agrave;ng nhanh.</strong></p>','172362341901.png','172362341901_710x475.png',1,1,'','','','','','',24,'Chủ nhật, 13/11/2016 10:13:43',38),(31,3,0,'Theo đó, từ nay đến hết ngày 30/11, chọn mua smartphone ','theo-do-tu-nay-den-het-ngay-3011-chon-mua-smartphone',' Theo đó, từ nay đến hết ngày 30/11, chọn mua smartphone Coolpad tại FPT Shop, bạn có ngay cơ hội trúng phiếu mua hàng trị giá đến 3.000.000 đồng                ','<p>&nbsp;Theo đ&oacute;, từ nay đến hết ng&agrave;y 30/11, chọn mua smartphone Coolpad tại FPT Shop, bạn c&oacute; ngay cơ hội tr&uacute;ng phiếu mua h&agrave;ng trị gi&aacute; đến 3.000.000 đồng&nbsp;</p>','288700871738.JPG','288700871738_710x475.jpg',1,1,'','','','','','',23,'Chủ nhật, 08/01/2017 18:24:32',30),(32,15,0,'Theo đó, từ nay đến hết ngày 30/11, chọn mua smartphone ','theo-do-tu-nay-den-het-ngay-3011-chon-mua-smartphone','Theo đó, từ nay đến hết ngày 30/11, chọn mua smartphone Coolpad tại FPT Shop            ','<p>Theo đ&oacute;, từ nay đến hết ng&agrave;y 30/11, chọn mua smartphone Coolpad tại FPT Shop &nbsp; &nbsp; &nbsp; &nbsp;</p>','309804789737.jpg','309804789737_710x475.jpg',1,1,'','','','','','',27,'Chủ nhật, 08/01/2017 22:17:36',41);
