INSERT INTO `table_tinloai1_3` VALUES (2,16,0,'Hướng dẫn mua trả góp','huong-dan-mua-tra-gop','','<p class=\"pHead\">TT - Sự ch&ecirc;nh lệch về kết quả thi, nguồn tuyển hiện c&oacute; của từng trường v&agrave; sự tr&ocirc;ng đợi v&agrave;o NV2, NV3 của c&aacute;c trường tốp giữa v&agrave; tốp dưới đang g&acirc;y &aacute;p lực l&ecirc;n mốc điểm s&agrave;n của Bộ GD-ĐT dự kiến sẽ c&ocirc;ng bố v&agrave;o ng&agrave;y 8-8.</p>\r\n<p class=\"pBody\">&nbsp;</p>\r\n<table class=\"tLegend\" style=\"border-collapse: separate; width: 40px;\" border=\"0\" cellspacing=\"2\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"lImage\" src=\"http://phienbancu.tuoitre.vn/tianyon/ImageView.aspx?ThumbnailID=511845\" alt=\"\" border=\"1\" hspace=\"0\" /></td>\r\n</tr>\r\n<tr>\r\n<td>Nh&oacute;m học sinh lớp 12A1 Trường THPT B&ugrave;i Thị Xu&acirc;n (TP.HCM) đạt điểm cao kỳ thi đại học chung vui với gi&aacute;o vi&ecirc;n chủ nhiệm (giữa) s&aacute;ng 2-8 - Ảnh: NHƯ H&Ugrave;NG</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"pBody\" align=\"center\">&nbsp;</p>\r\n<p class=\"pBody\">Việc x&aacute;c định được mức điểm s&agrave;n hợp l&yacute; sẽ l&agrave; một th&aacute;ch thức với Bộ GD-ĐT v&igrave; mức điểm s&agrave;n căn cứ cơ học tr&ecirc;n thống k&ecirc; điểm thi c&oacute; thể sẽ l&agrave; một mức s&agrave;n kh&ocirc;ng khả thi tr&ecirc;n thực tế.</p>\r\n<p class=\"pInterTitle\">Trường tuyển kh&ocirc;ng hết...</p>\r\n<p class=\"pBody\">Mặc d&ugrave; đề thi khối A năm nay được đ&aacute;nh gi&aacute; l&agrave; kh&oacute; hơn năm trước nhưng kết quả thi của c&aacute;c trường tốp đầu năm nay tập trung nhất ở mức 21-26 điểm. Ch&iacute;nh v&igrave; vậy nguồn tuyển của c&aacute;c trường n&agrave;y kh&ocirc;ng hề bị ảnh hưởng, điểm chuẩn tiếp tục duy tr&igrave; ở mức cao v&agrave; c&ograve;n tăng so với năm 2010. &Ocirc;ng Ho&agrave;ng Văn Ch&acirc;u, hiệu trưởng Trường ĐH Ngoại thương, đ&atilde; x&aacute;c nhận th&ocirc;ng tin điểm chuẩn của Trường ĐH Ngoại thương kh&ocirc;ng bị giảm s&uacute;t do mặt bằng điểm thi đồng đều ở mức cao.</p>\r\n<p class=\"pBody\">Đối với khối B, c&aacute;c trường y năm nay đều c&oacute; mặt bằng kết quả thi trội hơn hẳn so với năm 2010. Trường ĐH Y Th&aacute;i B&igrave;nh c&oacute; tới 1.289 th&iacute; sinh khối B đạt kết quả thi 20 điểm/ba m&ocirc;n trở l&ecirc;n (chưa t&iacute;nh điểm ưu ti&ecirc;n). Trong khi chỉ ti&ecirc;u tuyển sinh khối B của trường l&agrave; 640 v&agrave; khối A l&agrave; 60 (ng&agrave;nh dược). Trường ĐH Y H&agrave; Nội cũng dự kiến điểm chuẩn sẽ tăng v&igrave; c&oacute; nhiều th&iacute; sinh dự thi đạt điểm thi cao hơn năm trước. Tương tự, kết quả thi của th&iacute; sinh Trường ĐH Y dược TP.HCM cao n&ecirc;n điểm chuẩn dự kiến c&aacute;c ng&agrave;nh đều tăng. Dự kiến ng&agrave;nh tăng nhiều nhất tới 3 điểm, thấp nhất cũng 1 điểm...</p>\r\n<p class=\"pBody\">Ở khối D, cũng như Trường ĐH Ngoại thương, Học viện Ngoại giao cho biết với mặt bằng kết quả thi năm nay, dự kiến điểm chuẩn của trường sẽ c&oacute; một số ng&agrave;nh khối D1 cao hơn.</p>\r\n<p class=\"pBody\">H&agrave;ng loạt c&aacute;c trường ĐH tốp đầu kh&aacute;c cũng đ&atilde; dự kiến điểm chuẩn sẽ ở mức bằng hoặc tăng so với năm trước như ĐH Kinh tế quốc d&acirc;n, Học viện T&agrave;i ch&iacute;nh, ĐH Y khoa Phạm Ngọc Thạch, ĐH B&aacute;ch khoa H&agrave; Nội...</p>\r\n<p class=\"pInterTitle\">Trường lần chẳng ra</p>\r\n<p class=\"pBody\">Ngược lại, c&aacute;c trường tốp giữa lại c&oacute; mặt bằng điểm thi thấp hơn so với năm 2010 v&agrave; đều dự kiến mức điểm chuẩn thấp hơn. &Ocirc;ng Nguyễn Đức Trọng, trưởng ph&ograve;ng đ&agrave;o tạo Trường ĐH H&agrave;ng hải, cho biết dự kiến điểm chuẩn năm nay c&oacute; thể thấp hơn so với năm 2010. Tương tự, &ocirc;ng L&ecirc; Trọng Thắng, trưởng ph&ograve;ng đ&agrave;o tạo Trường ĐH Mỏ - địa chất, cho biết trường sẽ phải d&agrave;nh nhiều chỉ ti&ecirc;u để x&eacute;t tuyển NV2.</p>\r\n<p class=\"pBody\">Mặc d&ugrave; c&oacute; số lượng th&iacute; sinh dự thi tăng hơn nhiều so với năm trước nhưng c&aacute;c trường như ĐH Điện lực, ĐH C&ocirc;ng nghiệp H&agrave; Nội, ĐH C&ocirc;ng nghiệp TP.HCM, ĐH C&ocirc;ng đo&agrave;n, ĐH Hải Ph&ograve;ng, ĐH L&acirc;m nghiệp Việt Nam... cũng chỉ giữ được một số ng&agrave;nh c&oacute; mức điểm chuẩn bằng năm trước, c&ograve;n nhiều ng&agrave;nh sẽ phải giảm do kết quả thi kh&ocirc;ng cao. Theo &ocirc;ng B&ugrave;i Đức Hiền - trưởng ph&ograve;ng đ&agrave;o tạo Trường ĐH Điện lực, trong số 8.367 th&iacute; sinh dự thi khối A v&agrave; gần 600 th&iacute; sinh dự thi khối D (năm đầu ti&ecirc;n nh&agrave; trường tuyển sinh khối D), c&oacute; hơn 50% th&iacute; sinh đạt điểm tổng ba m&ocirc;n thi từ 10,0 trở l&ecirc;n.</p>\r\n<p class=\"pBody\">Ở ph&iacute;a Nam, h&agrave;ng loạt trường tốp giữa, tốp dưới c&oacute; mặt bằng điểm thi năm nay rất thấp, nhất l&agrave; ở khối A v&agrave; khối C. Kết quả thi của Trường ĐH Tr&agrave; Vinh chỉ c&oacute; 22/1.401 th&iacute; sinh dự thi khối A được điểm từ 13 trở l&ecirc;n. Nhiều ng&agrave;nh trường kh&ocirc;ng c&oacute; th&iacute; sinh n&agrave;o đạt mức 13 điểm. Trong khi đ&oacute;, tổng chỉ ti&ecirc;u của trường năm nay l&agrave;... 3.000, ri&ecirc;ng hệ ĐH l&ecirc;n đến 2.000. Theo thống k&ecirc; của Trường ĐH S&agrave;i G&ograve;n, khối C chỉ c&oacute; 432/2.294 th&iacute; sinh đạt từ 14 điểm trở l&ecirc;n. Ở khối B cũng chỉ c&oacute; 373/2.169 th&iacute; sinh đạt từ 14 điểm trở l&ecirc;n. Với mặt bằng điểm thi thấp hơn hẳn so với năm ngo&aacute;i, trường đang dự kiến điểm chuẩn một số ng&agrave;nh phải thấp hơn v&agrave; d&agrave;nh chỉ ti&ecirc;u cho NV2.</p>\r\n<p class=\"pInterTitle\">Điểm chuẩn khối C, D sẽ giảm</p>\r\n<p class=\"pBody\">Ở khối A v&agrave; B kh&ocirc;ng chỉ giảm điểm chuẩn, kh&ocirc;ng &iacute;t trường m&ugrave;a tuyển sinh năm nay sẽ phải x&aacute;c định điểm chuẩn ở mức thấp nhất c&oacute; thể, t&ugrave;y điểm s&agrave;n của Bộ</p>\r\n<p class=\"pBody\">GD-ĐT. Đối với khối C v&agrave; D, mặt bằng điểm thi của nhiều trường c&oacute; biến động, kết quả thi thấp hơn. Tương ứng với điều n&agrave;y, điểm chuẩn của hầu hết c&aacute;c trường khối C v&agrave; D được dự b&aacute;o sẽ giảm so với năm trước. Chỉ c&oacute; một số ng&agrave;nh trong c&aacute;c trường đa ng&agrave;nh v&agrave; một v&agrave;i trường sẽ duy tr&igrave; được mức điểm chuẩn bằng năm 2010.</p>\r\n<p class=\"pBody\">Ch&iacute;nh v&igrave; vậy, hầu hết c&aacute;c trường tốp giữa ở cả bốn khối thi năm nay đều đ&atilde; x&aacute;c định phải d&agrave;nh một tỉ lệ tương đối để x&eacute;t tuyển NV2. C&ograve;n c&aacute;c trường tốp dưới, d&ugrave; c&oacute; tổ chức thi, năm nay vẫn phải tr&ocirc;ng cậy gần như ho&agrave;n to&agrave;n v&agrave;o nguồn tuyển NV2, NV3.</p>\r\n<p class=\"pBody\">Nguồn tuyển NV2 sẽ từ số th&iacute; sinh kh&ocirc;ng tr&uacute;ng tuyển c&aacute;c trường tốp đầu v&agrave; tốp hai. Nếu mức điểm s&agrave;n tiếp tục được duy tr&igrave; như năm 2010, x&eacute;t về số lượng th&iacute; sinh đủ điều kiện tham gia x&eacute;t tuyển năm nay c&oacute; thể vẫn duy tr&igrave; được tỉ lệ giữa nguồn tuyển so với chỉ ti&ecirc;u như mọi năm. Nhưng tr&ecirc;n thực tế, nguồn tuyển của c&aacute;c trường tốp dưới vốn đ&atilde; kh&aacute;t th&iacute; sinh c&oacute; thể sẽ c&agrave;ng eo hẹp hơn.</p>\r\n<p class=\"pBody\">Trước hết, nh&oacute;m trường tốp giữa năm nay c&oacute; nhiều trường phải x&aacute;c định điểm chuẩn thấp hơn năm trước, tiến đến s&aacute;t điểm s&agrave;n. Nhiều trường &ldquo;tận dụng&rdquo; tối đa nguồn th&iacute; sinh bằng c&aacute;ch cho chuyển đổi ng&agrave;nh. V&igrave; vậy, nguồn tuyển c&ograve;n lại từ c&aacute;c trường n&agrave;y sẽ rất &iacute;t, đặt c&aacute;c trường tốp dưới v&agrave;o thế cực kỳ kh&oacute; khăn bởi số th&iacute; sinh nằm trong nguồn tuyển NV2 năm nay phần lớn sẽ l&agrave; th&iacute; sinh kh&ocirc;ng tr&uacute;ng tuyển v&agrave;o c&aacute;c trường tốp đầu.</p>\r\n<p class=\"pBody\">Nhưng theo thống k&ecirc; nguồn th&iacute; sinh tr&uacute;ng tuyển NV2 của nhiều trường những năm trước cho thấy th&iacute; sinh kh&ocirc;ng tr&uacute;ng tuyển c&aacute;c trường tốp đầu kh&ocirc;ng hề &ldquo;ng&oacute; ng&agrave;ng&rdquo; đến c&aacute;c trường tốp dưới, nhất l&agrave; trường ngo&agrave;i c&ocirc;ng lập. Từ thực tế n&agrave;y, c&oacute; thể nh&igrave;n thấy trước c&aacute;i kh&oacute; của c&aacute;c trường tốp dưới v&agrave; cả một số trường tốp giữa phải tr&ocirc;ng cậy nhiều v&agrave;o NV2, NV3.</p>\r\n<p class=\"pAuthor\">THANH H&Agrave;</p>','345019153727.jpg','345019153727_210x164.230769231.jpg',1,1,1312536194,'','','','','','',29),(3,3,0,'Câu hỏi thường gặp','cau-hoi-thuong-gap','','<p class=\"pHead\">TT - Từ mức 22.600 đồng/USD m&agrave; doanh nghiệp phải trả ở thời kỳ đỉnh điểm hồi đầu năm xuống c&ograve;n tr&ecirc;n 20.600 đồng/USD hiện nay, tỉ gi&aacute; đ&atilde; giảm được gần 8,85%.</p>\r\n<p class=\"pBody\">Sau nhiều th&aacute;ng tr&igrave; ho&atilde;n với l&yacute; do phải c&oacute; &ldquo;độ trễ&rdquo;, một số nh&agrave; cung cấp đ&atilde; chịu giảm gi&aacute; b&aacute;n v&agrave;i mặt h&agrave;ng ti&ecirc;u d&ugrave;ng.</p>\r\n<p class=\"pHead\">&nbsp;</p>\r\n<table class=\"tLegend\" style=\"border-collapse: separate; width: 40px;\" border=\"0\" cellspacing=\"2\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Thị trường thấp điểm c&agrave;ng đẩy doanh nghiệp kinh doanh h&agrave;ng điện m&aacute;y phải t&iacute;nh to&aacute;n lại gi&aacute; b&aacute;n trong bối cảnh tỉ gi&aacute; USD/VND giảm hơn hai th&aacute;ng qua Ảnh: M.ĐỨC</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"pHead\" align=\"center\">&nbsp;</p>\r\n<p class=\"pBody\">C&ugrave;ng với sức &eacute;p từ gi&aacute; USD, c&aacute;c yếu tố cạnh tranh, k&iacute;ch cầu ti&ecirc;u thụ cũng khiến doanh nghiệp kinh doanh h&agrave;ng nhập khẩu phải t&iacute;nh to&aacute;n lại phương &aacute;n gi&aacute; b&aacute;n.</p>\r\n<p class=\"pInterTitle\">Chủ động giảm gi&aacute;</p>\r\n<p class=\"pBody\">Đa số si&ecirc;u thị, cửa h&agrave;ng chuy&ecirc;n b&aacute;n đồ điện tử ở TP.HCM cho biết gi&aacute; c&aacute;c mặt h&agrave;ng n&agrave;y biến động từng ng&agrave;y. Nguy&ecirc;n nh&acirc;n do c&aacute;c nh&agrave; cung cấp chủ động điều chỉnh gi&aacute; tăng/giảm t&ugrave;y mặt h&agrave;ng, hoặc để cạnh tranh với c&aacute;c nh&agrave; ph&acirc;n phối kh&aacute;c dựa tr&ecirc;n tỉ gi&aacute; USD ni&ecirc;m yết đầu ng&agrave;y. Nh&acirc;n vi&ecirc;n một si&ecirc;u thị m&aacute;y t&iacute;nh v&agrave; h&agrave;ng điện tử tr&ecirc;n đường Nguyễn Thị Minh Khai, Q.1, TP.HCM cho biết rất kh&oacute; để rạch r&ograve;i gi&aacute; c&aacute;c sản phẩm đ&atilde; được điều chỉnh theo mức tỉ gi&aacute; hiện nay so với thời kỳ đỉnh điểm tr&ecirc;n 22.600 đồng/USD, bởi một số mặt h&agrave;ng giảm kh&aacute; mạnh do gi&aacute; h&agrave;ng nhập khẩu giảm.</p>\r\n<p class=\"pBody\">Chẳng hạn một chiếc tai nghe d&ugrave;ng cho m&aacute;y t&iacute;nh, mp3... nhập khẩu từ Trung Quốc hồi đầu năm c&oacute; gi&aacute; 120.000 đồng hiện chỉ c&ograve;n khoảng 106.000 đồng, giảm hơn 10.000 đồng/sản phẩm so với mức gi&aacute; đưa ra so s&aacute;nh hồi đầu năm. Theo những người b&aacute;n, gi&aacute; b&aacute;n giảm chủ yếu ở mặt h&agrave;ng linh kiện điện tử, điện thoại di động...</p>\r\n<p class=\"pBody\">Trong khi đ&oacute;, hiện một số doanh nghiệp nhập khẩu thực phẩm đ&atilde; chủ động giảm gi&aacute; b&aacute;n sỉ sau khi tr&igrave; ho&atilde;n một thời gian kh&aacute; d&agrave;i. H&agrave;ng nhập trong th&aacute;ng 4, th&aacute;ng 5 vừa qua đang được c&aacute;c doanh nghiệp đưa ra thị trường. Tại chợ đầu mối n&ocirc;ng sản thực phẩm B&igrave;nh Điền (Q.8, TP.HCM), gi&aacute; b&aacute;n sỉ mặt h&agrave;ng thịt heo đ&ocirc;ng lạnh, thịt g&agrave; đ&ocirc;ng lạnh đ&atilde; giảm 5.000-7.000 đồng/kg so với hồi đầu năm. &Ocirc;ng Đo&agrave;n Ngọc Thơ, gi&aacute;m đốc C&ocirc;ng ty THO (TP.HCM), cho biết tr&ecirc;n thực tế gi&aacute; b&aacute;n sỉ hiện nay đ&atilde; giảm khoảng 15% so với cuối th&aacute;ng 6-2011.</p>\r\n<p class=\"pBody\">&ldquo;Tỉ gi&aacute; chỉ giảm được 7-8% nếu t&iacute;nh theo ch&ecirc;nh lệch tỉ gi&aacute; hiện nay với tỉ gi&aacute; tr&ecirc;n thị trường tự do ở những l&uacute;c cao nhất, hơn nữa doanh nghiệp cũng thường xuy&ecirc;n mua được USD từ ng&acirc;n h&agrave;ng n&ecirc;n mức giảm gi&aacute; như tr&ecirc;n kh&ocirc;ng ho&agrave;n to&agrave;n nhờ tỉ gi&aacute; m&agrave; c&ograve;n do doanh nghiệp chủ động&rdquo; - &ocirc;ng Thơ cho biết. Theo c&aacute;c doanh nghiệp, mặt h&agrave;ng thực phẩm nhập khẩu đang c&oacute; nhiều yếu tố để giảm gi&aacute;. Nếu doanh nghiệp vẫn &ldquo;neo&rdquo; gi&aacute; ở mức cao như trước sẽ rất dễ mất thị trường.</p>\r\n<p class=\"pInterTitle\">Gi&aacute; c&oacute; giảm khi đến tay người ti&ecirc;u d&ugrave;ng?</p>\r\n<p class=\"pBody\">Tương tự, c&aacute;c mặt h&agrave;ng n&ocirc;ng sản, mỹ phẩm, nước uống được nhiều nh&agrave; nhập khẩu khẳng định đ&atilde; giảm gi&aacute;. &Ocirc;ng Nguyễn Vũ, chuy&ecirc;n kinh doanh h&agrave;ng h&oacute;a mỹ phẩm nhập khẩu từ Malaysia về TP.HCM, cho biết do trước đ&acirc;y gần như phải mua to&agrave;n bộ USD ở thị trường tự do để nhập h&agrave;ng n&ecirc;n khi gi&aacute; USD giảm lại, chắc chắn gi&aacute; b&aacute;n trong nước phải giảm theo.</p>\r\n<p class=\"pBody\">Tuy nhi&ecirc;n, gần đ&acirc;y chi ph&iacute; vận chuyển tăng n&ecirc;n khi bỏ sỉ chỉ giảm được khoảng 4-5% gi&aacute; c&aacute;c loại sữa tắm, dầu gội... so với mức gi&aacute; trung b&igrave;nh của qu&yacute; 1 năm nay, trong khi bỏ sỉ cho c&aacute;c cửa h&agrave;ng tạp h&oacute;a, c&aacute;c sạp h&oacute;a mỹ phẩm tại chợ lẻ lại kh&ocirc;ng thể kiểm so&aacute;t được gi&aacute; b&aacute;n lẻ đến tay người ti&ecirc;u d&ugrave;ng c&oacute; giảm hay kh&ocirc;ng.</p>\r\n<p class=\"pBody\">Ri&ecirc;ng đồ chơi trẻ em - mặt h&agrave;ng c&oacute; tới hơn 90% nguồn gốc nhập khẩu - theo nhận định của c&aacute;c tiểu thương &ldquo;gi&aacute; b&aacute;n đ&atilde; được điều chỉnh đ&aacute;ng kể&rdquo;. B&agrave; Thu Lệ, b&aacute;n h&agrave;ng đồ chơi trẻ em ở chợ B&igrave;nh T&acirc;y (Q.6), cho biết c&aacute;c nh&agrave; cung cấp đồ chơi trẻ em đ&atilde; chủ động giảm gi&aacute; nhiều loại &ocirc;t&ocirc;, xe m&ocirc; h&igrave;nh, th&uacute; nhồi b&ocirc;ng... từ gần một th&aacute;ng nay với mức gi&aacute; b&aacute;n sỉ v&agrave; b&aacute;n lẻ đều được giảm 2.000-3.000 đồng/sản phẩm đối với những loại đồ chơi c&oacute; gi&aacute; dưới 50.000 đồng/sản phẩm. C&aacute;c loại đồ chơi gi&aacute; cao hơn cũng giảm 6-7% gi&aacute; b&aacute;n.</p>\r\n<p class=\"pAuthor\">BẠCH HO&Agrave;N - TRẦN VŨ NGHI</p>','575912201644.jpg','575912201644_210x139.44.jpg',1,1,1312536264,'','','','','','',22),(24,15,0,'Hướng dẫn mua hàng online','huong-dan-mua-hang-online','','','','',1,1,0,'','','','','','',23);
