INSERT INTO `table_tinloai2_1` VALUES (57,0,'Cháy lớn trong Khu công nghiệp ở Biên Hòa','chay-lon-trong-khu-cong-nghiep-o-bien-hoa','    (TNO) Vào khoảng 21 giờ hôm nay 21.9, một vụ hỏa hoạn đã xảy ra tại Công ty TNHH Yupoong VN (nằm trong KCN Long Bình, TP.Biên Hòa, Đồng Nai) đã thiêu rụi một nhà xưởng cùng toàn bộ hàng hóa.                        ','<div>(TNO) V&agrave;o khoảng 21 giờ h&ocirc;m nay 21.9, một vụ hỏa hoạn đ&atilde; xảy ra tại C&ocirc;ng ty TNHH Yupoong VN (nằm trong KCN Long B&igrave;nh, TP.Bi&ecirc;n H&ograve;a, Đồng Nai) đ&atilde; thi&ecirc;u rụi một <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> c&ugrave;ng to&agrave;n bộ h&agrave;ng h&oacute;a.</div>\r\n<h2>&nbsp;<span style=\"font-size: 12px; line-height: 1.5;\">Theo th&ocirc;ng tin ban đầu, v&agrave;o thời điểm tr&ecirc;n khi c&aacute;c c&ocirc;ng nh&acirc;n của C&ocirc;ng ty Yupoong đang chuẩn bị v&agrave;o l&agrave;m ca ba th&igrave; ph&aacute;t hiện lửa b&ugrave;ng ch&aacute;y ở kho chứa h&agrave;ng h&oacute;a, mọi người đ&atilde; h&ocirc; ho&aacute;n nhau rồi bỏ chạy ra ngo&agrave;i. Nhận được tin b&aacute;o, Cảnh s&aacute;t PCCC C&ocirc;ng an tỉnh Đồng Nai đ&atilde; điều động 5 xe cứu hỏa c&ugrave;ng h&agrave;ng chục chiến sỹ đến hiện trường dập lửa.</span></h2>\r\n<div>Tuy nhi&ecirc;n, do trong kho chủ yếu l&agrave; vải v&agrave; h&agrave;ng h&oacute;a th&agrave;nh phầm gồm c&aacute;c loại n&oacute;n lưỡi trai n&ecirc;n bắt lửa rất nhanh v&agrave; ch&aacute;y dữ dội. Ngọn lửa đ&atilde; thi&ecirc;u rụi gần như to&agrave;n bộ h&agrave;ng h&oacute;a trong kho, l&agrave;m biến dạng cả những khung th&eacute;p. Thiệt hại ước t&iacute;nh h&agrave;ng chục tỉ đồng.&nbsp;</div>\r\n<div>\r\n<table class=\"imagefull done\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<div><img src=\"http://static.thanhnien.com.vn/uploaded/ngocthanh/2015_09_21/chay-xuong1_pzog.jpg?width=500\" alt=\"Ch&aacute;y lớn trong Khu c&ocirc;ng nghiệp ở Bi&ecirc;n H&ograve;a - ảnh 1\" width=\"810\" /></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><img src=\"http://static.thanhnien.com.vn/uploaded/ngocthanh/2015_09_21/chay-xuong2_zglp.jpg?width=689\" alt=\"Ch&aacute;y lớn trong Khu c&ocirc;ng nghiệp ở Bi&ecirc;n H&ograve;a - ảnh 2\" width=\"810\" /></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><img src=\"http://static.thanhnien.com.vn/uploaded/ngocthanh/2015_09_21/chay-xuong3_uior.jpg?width=689\" alt=\"Ch&aacute;y lớn trong Khu c&ocirc;ng nghiệp ở Bi&ecirc;n H&ograve;a - ảnh 3\" width=\"810\" /></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><img src=\"http://static.thanhnien.com.vn/uploaded/ngocthanh/2015_09_21/chay-xuong4_mrnz.jpg?width=500\" alt=\"Ch&aacute;y lớn trong Khu c&ocirc;ng nghiệp ở Bi&ecirc;n H&ograve;a - ảnh 4\" width=\"810\" /></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"http://static.thanhnien.com.vn/uploaded/ngocthanh/2015_09_21/chay-xuong5_vwnr.jpg?width=500\" alt=\"Ch&aacute;y lớn trong Khu c&ocirc;ng nghiệp ở Bi&ecirc;n H&ograve;a - ảnh 5\" width=\"810\" /><br /><span>&nbsp;</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>','072300621592.jpg','072300621592_710x350.jpg',1,1,'Thứ ba, 08/11/2016 11:49:25',7,'','','','','',''),(58,0,'Cháy trong Khu công nghiệp Nam Cấm, một nhà xưởng bị thiêu rụi','chay-trong-khu-cong-nghiep-nam-cam-mot-nha-xuong-bi-thieu-rui','    (TNO) Khoảng 15 giờ 20 phút chiều nay 20.1, một vụ hỏa hoạn xảy ra tại xưởng gỗ của Công ty Thanh Sơn, đóng tại Khu công nghiệp Nam Cấm (xóm 11 xã Nghi Xã, huyện Nghi Lộc, Nghệ An).                ','<div id=\"abody\">\r\n<div><span>Khoảng 15 giờ 20 ph&uacute;t chiều nay 20.1, một vụ hỏa hoạn xảy ra tại xưởng gỗ của C&ocirc;ng ty Thanh Sơn, đ&oacute;ng tại Khu c&ocirc;ng nghiệp Nam Cấm (x&oacute;m 11 x&atilde; Nghi X&atilde;, huyện Nghi Lộc, Nghệ An).</span></div>\r\n<div>\r\n<table class=\"imagefull\" style=\"width: 526px; height: 2014px;\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<div><a class=\"slide-photo\" title=\"  \" href=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0338_ypkx.jpg?width=500\" rel=\"prettyPhoto[thethao]\"><img src=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0338_ypkx.jpg?width=500\" alt=\"Ch&aacute;y trong Khu c&ocirc;ng nghiệp Nam Cấm, một nh&agrave; xưởng bị thi&ecirc;u rụi - ảnh 1\" /></a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><a class=\"slide-photo\" title=\"  \" href=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0332_dbnd.jpg?width=500\" rel=\"prettyPhoto[thethao]\"><img src=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0332_dbnd.jpg?width=500\" alt=\"Ch&aacute;y trong Khu c&ocirc;ng nghiệp Nam Cấm, một nh&agrave; xưởng bị thi&ecirc;u rụi - ảnh 2\" /></a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><a class=\"slide-photo\" title=\"  \" href=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0397_kkhb.jpg?width=500\" rel=\"prettyPhoto[thethao]\"><img src=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0397_kkhb.jpg?width=500\" alt=\"Ch&aacute;y trong Khu c&ocirc;ng nghiệp Nam Cấm, một nh&agrave; xưởng bị thi&ecirc;u rụi - ảnh 3\" /></a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><a class=\"slide-photo\" title=\"  \" href=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0347_yivg.jpg?width=500\" rel=\"prettyPhoto[thethao]\"><img src=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0347_yivg.jpg?width=500\" alt=\"Ch&aacute;y trong Khu c&ocirc;ng nghiệp Nam Cấm, một nh&agrave; xưởng bị thi&ecirc;u rụi - ảnh 4\" /></a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><a class=\"slide-photo\" title=\"  \" href=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0340_ndob.jpg?width=500\" rel=\"prettyPhoto[thethao]\"><img src=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0340_ndob.jpg?width=500\" alt=\"Ch&aacute;y trong Khu c&ocirc;ng nghiệp Nam Cấm, một nh&agrave; xưởng bị thi&ecirc;u rụi - ảnh 5\" /></a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div><a class=\"slide-photo\" title=\"\r\n            &lt;div&gt;Hiện trường vụ ch&aacute;y - Ảnh: Phạm Đức&lt;/div&gt;\r\n            \" href=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0366_obqe.jpg?width=500\" rel=\"prettyPhoto[thethao]\"><img src=\"http://static.thanhnien.com.vn/uploaded/congthang/2015_01_20/img_0366_obqe.jpg?width=500\" alt=\"Ch&aacute;y trong Khu c&ocirc;ng nghiệp Nam Cấm, một nh&agrave; xưởng bị thi&ecirc;u rụi - ảnh 6\" /></a>\r\n<div>Hiện trường vụ ch&aacute;y - Ảnh: Phạm Đức</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>Anh Nguyễn Văn B&igrave;nh, c&ocirc;ng nh&acirc;n của C&ocirc;ng ty Thanh Sơn, cho biết v&agrave;o thời điểm tr&ecirc;n c&oacute; 3 c&ocirc;ng nh&acirc;n đang h&agrave;n ở ph&iacute;a tr&ecirc;n m&aacute;i nh&agrave;. C&aacute;c tia lửa h&agrave;n rơi xuống bao b&igrave; ph&iacute;a trong nh&agrave; xưởng n&ecirc;n lửa bắt đầu bốc l&ecirc;n. Chỉ &iacute;t ph&uacute;t sau, ngọn lửa bao tr&ugrave;m to&agrave;n bộ khu <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a>.</div>\r\n<div>Đại t&aacute; L&ecirc; Quốc Bảo, Ph&oacute; gi&aacute;m đốc Sở Cảnh s&aacute;t ph&ograve;ng ch&aacute;y chữa ch&aacute;y, C&ocirc;ng an tỉnh Nghệ An, cho biết nhận được tin b&aacute;o của người d&acirc;n, 10 ph&uacute;t sau lực lượng chữa ch&aacute;y huy động 70 c&aacute;n bộ chiến sĩ, 50 c&aacute;n bộ v&agrave; c&ocirc;ng an x&atilde;, đội d&acirc;n qu&acirc;n tự vệ, cảnh s&aacute;t giao th&ocirc;ng tham gia chữa ch&aacute;y. 7 xe cứu hỏa được điều động tới hiện trường để dập lửa.</div>\r\n<div>&ldquo;Do khu vực nh&agrave; kho chứa nhiều vật liệu dễ ch&aacute;y như bao b&igrave;, gỗ &eacute;p&hellip; n&ecirc;n ngọn lửa lan nhanh. Đặc biệt <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> n&agrave;y kh&ocirc;ng c&oacute; lối tho&aacute;t hiểm, c&aacute;c cửa đều kh&oacute;a n&ecirc;n ch&uacute;ng t&ocirc;i phải d&ugrave;ng b&uacute;a ph&aacute; cửa để tiếp cận đ&aacute;m ch&aacute;y. 10 ph&uacute;t sau ch&uacute;ng t&ocirc;i khống chế được&nbsp;<a href=\"http://www.thanhnien.com.vn/chinh-tri-xa-hoi/giai-cuu-mot-cu-ba-thoat-khoi-dam-chay-515043.html\" target=\"_blank\">đ&aacute;m ch&aacute;y</a>&rdquo;, đại t&aacute; Bảo n&oacute;i.</div>\r\n<div>Ghi nhận của PV tại hiện trường cho thấy, to&agrave;n bộ m&aacute;y m&oacute;c của <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> bị thi&ecirc;u rụi, rất may kh&ocirc;ng c&oacute; thiệt hại về người.</div>\r\n<div>Theo th&ocirc;ng tin ban đầu, vụ hỏa hoạn g&acirc;y thiệt hại h&agrave;ng trăm triệu đồng, nguy&ecirc;n nh&acirc;n đang được điều tra l&agrave;m r&otilde;.</div>\r\n</div>\r\n<p><strong>Phạm Đức</strong></p>','418307446907.png','418307446907_710x350.png',2,1,'Thứ ba, 08/11/2016 11:50:09',7,'','','','','',''),(59,0,'Ông lớn nước ngoài tăng tốc xây dựng kho, xưởng tại Việt Nam','ong-lon-nuoc-ngoai-tang-toc-xay-dung-kho-xuong-tai-viet-nam','    CBRE cho biết, các chủ đầu tư trong và ngoài nước đang quan tâm tiến hành xây dựng và mở rộng cơ sở hạ tầng cho thuê của mình.                ','<p>Trong b&aacute;o c&aacute;o Điểm tin thị trường BĐS TPHCM 2014, C&ocirc;ng ty tư vấn BĐS CBRE cho biết, ph&acirc;n kh&uacute;c BĐS khu c&ocirc;ng nghiệp tại TPHCM n&oacute;i ri&ecirc;ng v&agrave; ph&iacute;a Nam n&oacute;i chung c&oacute; nhiều khởi sắc.</p>\r\n<p>Cụ thể, CBRE cho rằng,<em><strong>&nbsp;c&aacute;c nh&agrave; đầu tư nước ngo&agrave;i đang đẩy nhanh tiến tr&igrave;nh tham gia thị trường hoặc mở rộng hoạt động kinh doanh tại Việt Nam</strong></em>, đặc biệt trong lĩnh vực may mặc v&agrave; c&ocirc;ng nghiệp dệt với mong muốn được hưởng c&aacute;c lợi &iacute;ch từ hiệp định TPP.</p>\r\n<p>C&aacute;c dự &aacute;n nổi bật c&oacute; thể liệt k&ecirc; như Nobland VN tăng vốn đầu tư từ 43 triệu USD đến 61 triệu USD, Gain Lucky tăng từ 140 triệu USD đến 300 triệu USD chỉ trong v&ograve;ng 1 năm. Trong qu&yacute; khảo s&aacute;t, dệt Nam Phương, li&ecirc;n doanh hợp t&aacute;c giữa Haputex v&agrave; c&ocirc;ng ty Việt Hương, đ&atilde; khởi c&ocirc;ng dự &aacute;n nh&agrave; m&aacute;y với tổng chi ph&iacute; đầu tư 120 triệu USD chỉ sau 20 ng&agrave;y kể từ ng&agrave;y được cấp ph&eacute;p đầu tư.</p>\r\n<div class=\"VCSortableInPreviewMode\">\r\n<div><img id=\"img_2962\" title=\"\" src=\"http://cafef.vcmedia.vn/k:2015/v1-1421982434572/ong-lon-nuoc-ngoai-tang-toc-xay-dung-kho-xuong-tai-viet-nam.png\" alt=\"\" /></div>\r\n<div class=\"PhotoCMS_Caption\">&nbsp;</div>\r\n</div>\r\n<p>CBRE cũng cho biết, do nhu cầu thu&ecirc; c&aacute;c <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> x&acirc;y sẵn c&oacute; quy m&ocirc; vừa v&agrave; nhỏ được cải thiện,&nbsp;<em><strong>c&aacute;c chủ đầu tư trong v&agrave; ngo&agrave;i nước đang quan t&acirc;m tiến h&agrave;nh x&acirc;y dựng v&agrave; mở rộng cơ sở hạ tầng cho thu&ecirc; của m&igrave;nh</strong></em>. Kizuna dự kiến sẽ khởi c&ocirc;ng giai đoạn 2 cho dự &aacute;n của m&igrave;nh v&agrave;o th&aacute;ng ba tới. Giai đoạn ba tại khu c&ocirc;ng nghiệp của Mapletree đ&atilde; sẵn s&agrave;ng ch&agrave;o đ&oacute;n kh&aacute;ch thu&ecirc; v&agrave; Vietpan Techno Park, dự &aacute;n tập trung v&agrave;o kh&aacute;ch h&agrave;ng Nhật Bản cũng đ&atilde; được ch&agrave;o thu&ecirc;.</p>\r\n<div class=\"VCSortableInPreviewMode\">\r\n<div><img id=\"img_2963\" title=\"\" src=\"http://cafef.vcmedia.vn/k:2015/v2-1421982434580/ong-lon-nuoc-ngoai-tang-toc-xay-dung-kho-xuong-tai-viet-nam.png\" alt=\"\" /></div>\r\n<div class=\"PhotoCMS_Caption\">&nbsp;</div>\r\n</div>\r\n<p>Với mối tương quan giữa nguồn cầu tăng v&agrave; nguồn cung mới, CBRE cho rằng gi&aacute; thu&ecirc; sẽ ổn định tr&ecirc;n phạm vi to&agrave;n quốc. Tuy nhi&ecirc;n, theo sau những dự &aacute;n đường cao tốc vừa ho&agrave;n th&agrave;nh như cao tốc Long Th&agrave;nh - Dầu Gi&acirc;y đoạn kết nối th&agrave;nh phố Hồ Ch&iacute; Minh với Đồng Nai, cao tốc H&agrave; Nội - Th&aacute;i Nguy&ecirc;n kết nối H&agrave; Nội đến đường bi&ecirc;n giới Trung Quốc, dự kiến gi&aacute; thu&ecirc; tại c&aacute;c khu c&ocirc;ng nghiệp tọa lạc tại c&aacute;c khu vực l&acirc;n cận sẽ tăng dần.</p>\r\n<p>Trước đ&oacute;, C&ocirc;ng ty tu vấn BĐS Cushman &amp; Wakefield cũng cho biết hoạt động cho thu&ecirc; tại c&aacute;c KCN c&oacute; dấu hiệu tăng trưởng nhẹ so năm trước. Gi&aacute; ch&agrave;o thu&ecirc; trung b&igrave;nh trong tại TPHCM trong qu&yacute; 4 năm 2014 kh&ocirc;ng đổi so với qu&yacute; trước cũng như c&ugrave;ng kỳ năm trước, đạt gần 2,6 triệu đồng/m2/thời hạn thu&ecirc; (khoảng 122 USD/m2/thời hạn thu&ecirc;). Gi&aacute; thu&ecirc; n&agrave;y cao hơn gấp hai lần so với Long An, B&igrave;nh Dương v&agrave; Đồng Nai.</p>\r\n<p>Cushman &amp; Wakefield cũng dự b&aacute;o, từ nay đến năm 2020, tổng nguồn cung tại TPHCM ước t&iacute;nh sẽ tăng l&ecirc;n khoảng 3.000 ha, tăng 85% so với nguồn cung hiện tại. Về số lượng c&aacute;c KCN, 18 KCN hiện tại được mở rộng v&agrave; khoảng 12 KCN mới sẽ đi v&agrave;o hoạt động trong năm 2020. Đa phần c&aacute;c dự &aacute;n tương lai đang trong qu&aacute; tr&igrave;nh giải ph&oacute;ng mặt bằng, đền b&ugrave; v&agrave; đợi được ph&ecirc; duyệt.</p>\r\n<p><span>Theo Tr&iacute; thức trẻ</span></p>','605437281300.jpg','605437281300_710x350.jpg',3,1,'Thứ ba, 08/11/2016 11:50:15',4,'','','','','',''),(62,0,'Dịch vụ cho thuê nhà xưởng “5 sao”','dich-vu-cho-thue-nha-xuong-5-sao','     Dịch vụ xây khu nhà xưởng cho thuê được ví von như mô hình khách sạn 5 sao với trang bị két sắt, xe, văn phòng tiếp khách, máy in... thu hút nhiều doanh nghiệp (DN) nước ngoài.                    ','<p>Dịch vụ <strong><a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">cho thu&ecirc; nh&agrave; xưởng gi&aacute; rẻ </a></strong>&nbsp;&ldquo;5 sao&rdquo; đang&nbsp;được xem như giải ph&aacute;p mới trong thu h&uacute;t đầu tư.</p>\r\n<p>Khi c&ocirc;ng nh&acirc;n đang hối hả l&agrave;m việc, &ocirc;ng Hosomi Junya - gi&aacute;m đốc C&ocirc;ng ty TAT (100% vốn Nhật) - dẫn ch&uacute;ng t&ocirc;i đi thăm th&uacute; một v&ograve;ng quanh khu <strong><a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> </strong>x&acirc;y sẵn với 500m<sup>2</sup>&nbsp;m&agrave; &ocirc;ng vừa thu&ecirc; cho c&ocirc;ng ty hoạt động.</p>\r\n<p>Giọng hồ hởi, &ocirc;ng Hosomi Junya kể: &ldquo;Năm ngo&aacute;i khi v&agrave;o đ&acirc;y ch&uacute;ng t&ocirc;i chỉ cần x&aacute;ch bal&ocirc;, mang m&aacute;y m&oacute;c v&agrave;o l&agrave; c&oacute; thể sản xuất ngay lập tức. Ở đ&acirc;y chủ cho thu&ecirc; c&ograve;n lo trọn g&oacute;i miễn ph&iacute; việc l&agrave;m c&aacute;c loại giấy tờ để một DN th&agrave;nh lập mới c&oacute; thể đi v&agrave;o hoạt động n&ecirc;n ch&uacute;ng t&ocirc;i vừa tiết kiệm được chi ph&iacute; đầu tư ban đầu, vừa tiết kiệm thời gian&rdquo;.</p>\r\n<p class=\"ck_inner_title\">Nh&agrave; xưởng &ldquo;5 sao&rdquo;</p>\r\n<p>C&ocirc;ng ty TAT chuy&ecirc;n gia c&ocirc;ng sản xuất kim loại, c&ocirc;ng ty mẹ đ&atilde; hoạt động ở Nhật kh&aacute; l&acirc;u nhưng đ&acirc;y l&agrave; lần đầu ti&ecirc;n họ đầu tư ra nước ngo&agrave;i. <a href=\"http://nhaxuonggiare.com.vn/index.html\">Nh&agrave; xưởng</a> m&agrave; C&ocirc;ng ty TAT thu&ecirc; thuộc khu <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> dịch vụ Kizuna nằm trong Khu c&ocirc;ng nghiệp (KCN) T&acirc;n Kim (Cần Giuộc, Long An).</p>\r\n<p>Trước khi v&agrave;o VN, &ocirc;ng Hosomi Junya đ&atilde; mở ra hai b&agrave;i to&aacute;n để so s&aacute;nh: nếu tự x&acirc;y dựng một khu <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> 500m<sup>2</sup>&nbsp;tại VN như DN bạn &ocirc;ng đ&atilde; l&agrave;m th&igrave; mất khoảng 350.000 USD (khoảng 7 tỉ đồng), chưa kể phải mất từ một năm rưỡi đến hai năm để ho&agrave;n th&agrave;nh c&aacute;c thủ tục thu&ecirc; đất, x&acirc;y <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a>, xin giấy ph&eacute;p đầu tư...</p>\r\n<p>Trong khi đ&oacute; nếu thu&ecirc; <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a> chỉ mất mỗi th&aacute;ng khoảng 2.500 USD. Tức trung b&igrave;nh khoảng 5 USD/th&aacute;ng/m<sup>2</sup>&nbsp;v&agrave; giảm được rất nhiều thời gian nhờ c&aacute;c dịch vụ đi k&egrave;m.</p>\r\n<p>Nếu như &ocirc;ng Hosomi Junya t&acirc;m đắc với việc c&oacute; thể x&aacute;ch bal&ocirc; v&agrave;o l&agrave; c&oacute; thể sản xuất ngay th&igrave; vị tổng gi&aacute;m đốc người H&agrave;n Quốc Byun Joon Seok của C&ocirc;ng ty Somang Vina lại h&agrave;i l&ograve;ng với c&aacute;c dịch vụ chăm s&oacute;c DN trong c&aacute;c khu nh&agrave; xưởng dịch vụ n&agrave;y.</p>\r\n<p>&Ocirc;ng Byun Joon Seok cho biết c&ocirc;ng ty muốn n&acirc;ng h&agrave;ng h&oacute;a th&igrave; thay v&igrave; phải đầu tư xe n&acirc;ng 400-500 triệu, ở đ&acirc;y đ&atilde; c&oacute; xe dịch vụ cho thu&ecirc;, thậm ch&iacute; cả k&eacute;t sắt, m&aacute;y in, văn ph&ograve;ng hội họp...</p>\r\n<p>&ldquo;Hiện nay c&aacute;c DN vừa v&agrave; nhỏ của H&agrave;n Quốc c&oacute; nhu cầu thu&ecirc; nh&agrave; xưởng dịch vụ rất lớn khi đầu tư v&agrave;o VN. Nhu cầu của họ lớn đến mức t&ocirc;i nghĩ nếu c&oacute; điều kiện thu&ecirc; được đất t&ocirc;i cũng đầu tư nh&agrave; xưởng dịch vụ như vậy để cho họ thu&ecirc; lại&rdquo;- &ocirc;ng Byun Joon Seok giải th&iacute;ch.</p>\r\n<p>Hiện ở Kizuna 1 c&oacute; 32 DN đang hoạt động, thế nhưng nhiều người đến lần đầu dễ bị lầm tưởng khu nghỉ dưỡng với nhiều dịch vụ tiện &iacute;ch k&egrave;m theo. B&agrave; L&acirc;m Diệu T&acirc;m Hiếu - tổng gi&aacute;m đốc C&ocirc;ng ty CP Kizuna JV - cho biết khu Kizuna 1 c&oacute; quy m&ocirc; 5ha, với tổng vốn đầu tư 10 triệu USD.</p>\r\n<p>D&ugrave; mới đi v&agrave;o hoạt động năm 2014 nhưng nay khu n&agrave;y đ&atilde; lấp đầy 100%, phần lớn l&agrave; DN nhỏ nước ngo&agrave;i. &ldquo;Nhu cầu của nh&agrave; đầu tư rất lớn n&ecirc;n ch&uacute;ng t&ocirc;i quyết định mở th&ecirc;m Kizuna 2 với quy m&ocirc; 6ha&rdquo;- b&agrave; Hiếu n&oacute;i giọng phấn khởi.</p>\r\n<p class=\"ck_inner_title\">Nở rộ &ldquo;chung cư\"</p>\r\n<p>Kh&ocirc;ng chỉ khu Kizuna ở Long An, m&ocirc; h&igrave;nh nh&agrave; xưởng x&acirc;y sẵn cũng nở rộ tại nhiều KCN ở TP.HCM.</p>\r\n<p>Sau th&agrave;nh c&ocirc;ng lấp đầy 100% tại hai khu nh&agrave; xưởng ti&ecirc;u chuẩn cao t&aacute;m tầng ở Khu chế xuất (KCX) T&acirc;n Thuận (Q.7, TP.HCM), chủ đầu tư dự &aacute;n n&agrave;y l&agrave; C&ocirc;ng ty TNHH T&acirc;n Thuận đang triển khai tiếp dự &aacute;n thứ ba.</p>\r\n<p>Một vị đại diện c&ocirc;ng ty n&agrave;y cho hay tổng diện t&iacute;ch khu đất x&acirc;y dựng nh&agrave; xưởng cao tầng hơn 18.190m<sup>2</sup>, c&aacute;c nh&agrave; xưởng c&oacute; độ cao t&aacute;m tầng, diện t&iacute;ch s&agrave;n hơn 15.760m<sup>2</sup>, tầng hầm 1.970m<sup>2</sup>&nbsp;v&agrave; nh&agrave; xe ba tầng c&oacute; diện t&iacute;ch s&agrave;n 1.687m<sup>2</sup>.</p>\r\n<p>Mỗi block nh&agrave; xưởng trang bị ba thang m&aacute;y chở người v&agrave; hai thang tải h&agrave;ng với tải trọng đa dạng từ 400-1.000kg/m<sup>2</sup>. Hiện nay nh&agrave; xưởng thứ ba đang ở giai đoạn ho&agrave;n thiện, lắp đặt trang thiết bị v&agrave; dự kiến hoạt động v&agrave;o th&aacute;ng  10-2015.</p>\r\n<p>Tại một số nơi như KCX Linh Trung, KCN Hiệp Phước... cũng đang x&acirc;y dựng m&ocirc; h&igrave;nh <a href=\"http://nhaxuonggiare.com.vn/\">nh&agrave; xưởng</a> cao tầng. Trong đ&oacute;, tại KCX Linh Trung đang lập phương &aacute;n thiết kế với quy m&ocirc; cao bảy tầng v&agrave; một tầng hầm. C&ograve;n tại KCN Hiệp Phước dự &aacute;n <a href=\"http://nhaxuonggiare.com.vn/\">nh&agrave; xưởng</a> cao s&aacute;u tầng sẽ được triển khai giai đoạn một với 20.000m<sup>2</sup>.</p>\r\n<p>Quy m&ocirc; 4 block<a href=\"http://nhaxuonggiare.com.vn/\"> nh&agrave; xưởng</a> cao tầng với tổng diện t&iacute;ch s&agrave;n x&acirc;y dựng 45.400m<sup>2</sup>. Dự &aacute;n n&agrave;y đ&atilde; được Ban quản l&yacute; c&aacute;c KCX - KCN TP.HCM (Hepza) trao giấy chứng nhận đầu tư ng&agrave;y 30-6-2015, hiện chủ đầu tư đang gấp r&uacute;t triển khai thủ tục để x&acirc;y dựng v&agrave;o th&aacute;ng 12-2015.</p>\r\n<table class=\"dbox\" border=\"0\" cellspacing=\"4\" cellpadding=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p class=\"ck_inner_title\">C&aacute;c nước đ&atilde; l&agrave;m từ l&acirc;u</p>\r\n<p>Theo &ocirc;ng Nguyễn Bạch Ho&agrave;ng Phụng - ph&oacute; ban quản l&yacute; Hepza, m&ocirc; h&igrave;nh <a href=\"http://nhaxuonggiare.com.vn/\">nh&agrave; xưởng</a> cao tầng tr&ecirc;n thế giới, đặc biệt ở c&aacute;c nước ph&aacute;t triển l&agrave; kh&ocirc;ng mới. Như ở Singapore, c&aacute;c khu <a href=\"http://nhaxuonggiare.com.vn/\">nh&agrave; xưởng</a> cao tầng được x&acirc;y dựng hiện đại đến mức xe tải c&oacute; đường để chạy l&ecirc;n tận nh&agrave; xưởng tr&ecirc;n tầng cao.</p>\r\n<p>Tuy nhi&ecirc;n tại VN đ&acirc;y l&agrave; m&ocirc; h&igrave;nh mới triển khai. &ldquo;M&ocirc; h&igrave;nh n&agrave;y ph&ugrave; hợp với những nơi đ&atilde; c&oacute; hạ tầng ho&agrave;n chỉnh, khi x&acirc;y dựng l&ecirc;n cao th&igrave; đa dạng h&oacute;a được sản phẩm để DN trong v&agrave; ngo&agrave;i nước lựa chọn thay v&igrave; chỉ đầu tư v&agrave;o nh&agrave; xưởng thấp tầng&rdquo;.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"wrapper-qt\">\r\n<div class=\"qtam_social btn-qt\">\r\n<div id=\"like_thread\">&nbsp;</div>\r\n</div>\r\n<strong>Đ&Igrave;NH D&Acirc;N (<a href=\"mailto:dinhdan@tuoitre.com.vn\">dinhdan@tuoitre.com.vn</a>)</strong></div>\r\n<div class=\"wrapper-qt\"><hr />\r\n<p><strong><span>C&Ocirc;NG TY CỔ PHẦN CƠ KH&Iacute; X&Acirc;Y DỰNG BIỂN VIỆT</span></strong></p>\r\n<p><span>Địa chỉ: 10/42 L&ecirc; Qu&yacute; Đ&ocirc;n, KP4, P.T&acirc;n Hiệp, Tp.Bi&ecirc;n H&ograve;a, Đồng Nai</span></p>\r\n<p><span>Điện thoại: 061.3857396 Hotline: Mr H&ugrave;ng: 0904.303517; Mr Minh: 0913.797516</span></p>\r\n<p><span><span>Fax: 061.3857396&nbsp;</span><span>Email :&nbsp;</span><span class=\"gI\"><a href=\"mailto:xdbienviet@gmail.com\">xdbienviet@gmail.com</a>&nbsp; Website:&nbsp;<a href=\"http://nhaxuonggiare.com.vn/index.html\">nhaxuonggiare.com.vn</a></span></span></p>\r\n</div>','116142827011.JPG','116142827011_710x350.jpg',1,1,'Thứ ba, 08/11/2016 11:49:45',5,'','','','','',''),(65,0,'Nhà xưởng xây sẵn hút nhà đầu tư','nha-xuong-xay-san-hut-nha-dau-tu','    Nhiều doanh nghiệp nước ngoài, đặc biệt là doanh nghiệp vừa và nhỏ, đến VN đầu tư có xu hướng tìm các khu nhà xưởng đã xây sẵn để giảm chi phí đầu tư ban đầu và hạn chế rủi ro.                ','<p class=\"pBody\">Nhiều chuy&ecirc;n gia cho rằng đ&acirc;y l&agrave; cơ hội cho nhiều nh&agrave; đầu tư bất động sản khu c&ocirc;ng nghiệp. Tuy nhi&ecirc;n, hoạt động n&agrave;y kh&ocirc;ng phải dễ ăn do đặc th&ugrave; &ldquo;đầu tư tiền chẵn, thu bạc lẻ&rdquo;.</p>\r\n<p class=\"pInterTitle\">Săn l&ugrave;ng <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng&nbsp;gi&aacute; rẻ</a></p>\r\n<p class=\"pBody\">&nbsp;</p>\r\n<table style=\"width: 35%;\" align=\"right\">\r\n<tbody>\r\n<tr>\r\n<td class=\"pBody\">\r\n<p class=\"pInterTitle\">K&eacute;o kh&aacute;ch thu&ecirc; bằng dịch vụ cộng th&ecirc;m</p>\r\n<p class=\"pBody\">Do gi&aacute; cho thu&ecirc; nh&agrave; xưởng x&acirc;y sẵn tại c&aacute;c khu c&ocirc;ng nghiệp ở TP.HCM, Long An, B&igrave;nh Dương, Đồng Nai... kh&ocirc;ng ch&ecirc;nh lệch nhiều, n&ecirc;n nhiều doanh nghiệp cạnh tranh nhau bằng c&aacute;c dịch vụ cộng th&ecirc;m. Chẳng hạn, c&aacute;c nh&agrave; đầu tư khi thu&ecirc; nh&agrave; xưởng sẽ được lo dịch vụ từ <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a> cho đến thủ tục giấy ph&eacute;p đầu tư, thậm ch&iacute; đến nh&acirc;n vi&ecirc;n phục vụ cũng được trang bị ngoại ngữ, kỹ năng hỗ trợ doanh nghiệp.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class=\"pBody\">Sau khi chọn được một <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a> x&acirc;y sẵn tại Khu c&ocirc;ng nghiệp T&acirc;n Kim (Long An), &ocirc;ng Massaki Demura - trưởng ph&ograve;ng vật tư của C&ocirc;ng ty Tabuchi Corp (Nhật, chuy&ecirc;n sản xuất thiết bị van cấp nước) - h&agrave;o hứng cho biết phải mất đến nửa năm, khảo s&aacute;t tại nhiều khu c&ocirc;ng nghiệp ở Đồng Nai, B&igrave;nh Dương, TP.HCM..., cuối c&ugrave;ng mới chọn được nh&agrave; xưởng ưng &yacute; tại Long An. &ldquo;Kh&ocirc;ng chỉ nh&agrave; xưởng n&agrave;y gần TP.HCM, tại đ&acirc;y c&ograve;n c&oacute; c&aacute;c nh&acirc;n vi&ecirc;n biết n&oacute;i tiếng Nhật v&agrave; c&oacute; dịch vụ lo giấy ph&eacute;p đầu tư&rdquo; - &ocirc;ng Demura n&oacute;i.</p>\r\n<p class=\"pBody\">Theo &ocirc;ng Demura, đ&acirc;y l&agrave; dự &aacute;n đầu tư ra nước ngo&agrave;i đầu ti&ecirc;n của Tabuchi Corp n&ecirc;n c&ocirc;ng ty muốn thu&ecirc; một nh&agrave; xưởng x&acirc;y sẵn, vừa giảm 20-30% chi ph&iacute; vốn x&acirc;y dựng, vừa giảm được rủi ro khi lần đầu ti&ecirc;n đầu tư ra nước ngo&agrave;i.</p>\r\n<p class=\"pBody\">Dẫn ch&uacute;ng t&ocirc;i tham quan khu nh&agrave; xưởng vừa thu&ecirc;, &ocirc;ng Masayoshi Mishima - gi&aacute;m đốc C&ocirc;ng ty TNHH TK Mesh Japan (100% vốn Nhật) - cho rằng với <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng vừa thu&ecirc;</a>, c&ocirc;ng ty chỉ cần lắp r&aacute;p m&aacute;y m&oacute;c, d&acirc;y chuyền l&agrave; c&oacute; thể đi v&agrave;o sản xuất ngay. Đ&acirc;y l&agrave; hai trong h&agrave;ng loạt doanh nghiệp Nhật Bản, phần lớn l&agrave; doanh nghiệp vừa v&agrave; nhỏ, đ&atilde; sang VN t&igrave;m kiếm cơ hội đầu tư, săn l&ugrave;ng c&aacute;c nh&agrave; xưởng x&acirc;y sẵn với dịch vụ trọn g&oacute;i để mở nh&agrave; m&aacute;y. &ldquo;Ch&uacute;ng t&ocirc;i hi vọng m&ocirc; h&igrave;nh <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a> x&acirc;y sẵn sẽ được nh&acirc;n rộng tại c&aacute;c khu c&ocirc;ng nghiệp ở VN, tạo cơ hội cho c&aacute;c doanh nghiệp vừa v&agrave; nhỏ như ch&uacute;ng t&ocirc;i dễ d&agrave;ng bắt tay v&agrave;o lắp r&aacute;p m&aacute;y m&oacute;c v&agrave; sản xuất ngay thay v&igrave; phải mất thời gian x&acirc;y <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a>&rdquo; - &ocirc;ng Masayoshi Mishima n&oacute;i.</p>\r\n<p class=\"pBody\">Kh&ocirc;ng chỉ doanh nghiệp Nhật, nhiều doanh nghiệp vừa v&agrave; nhỏ đến từ c&aacute;c quốc gia kh&aacute;c cũng săn t&igrave;m c&aacute;c khu <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a> chất lượng cao của VN để mở nh&agrave; m&aacute;y. &Ocirc;ng Tony Grosso, gi&aacute;m đốc C&ocirc;ng ty TNHH MTV Perfect Trading Total International (100% vốn &Uacute;c, chuy&ecirc;n về c&agrave; ph&ecirc; v&agrave; m&aacute;y rang xay c&agrave; ph&ecirc;), cho biết sau khi quyết định đầu tư v&agrave;o VN, c&ocirc;ng ty n&agrave;y đ&atilde; cử nh&acirc;n vi&ecirc;n đến VN t&igrave;m kiếm c&aacute;c nh&agrave; xưởng x&acirc;y sẵn. Tuy nhi&ecirc;n, kh&ocirc;ng dễ t&igrave;m được một nh&agrave; xưởng vừa &yacute;. &ldquo;Một số nh&agrave; xưởng c&oacute; gi&aacute; cho thu&ecirc; mềm nhưng lại xa TP.HCM, số kh&aacute;c th&igrave; gi&aacute; cả hay m&ocirc;i trường quản l&yacute; kh&ocirc;ng ph&ugrave; hợp. Chỉ khi t&igrave;m được khu nh&agrave; xưởng dịch vụ Kizuna 1 (Long An) ch&uacute;ng t&ocirc;i mới h&agrave;i l&ograve;ng, n&ecirc;n quyết định thu&ecirc; 650m2 v&agrave; trụ lại đ&acirc;y&rdquo; - &ocirc;ng Tony Grosso cho biết.</p>\r\n<p class=\"pInterTitle\">Tiềm năng nhưng cần vốn d&agrave;i hạn</p>\r\n<p class=\"pBody\">Nhiều doanh nghiệp cho biết những năm gần đ&acirc;y, số lượng c&aacute;c <a href=\"http://nhaxuonggiare.com.vn/danh-muc-list/cho-thue-nha-xuong-gia-re-32.html\">nh&agrave; xưởng</a> x&acirc;y sẵn đ&atilde; mọc l&ecirc;n ng&agrave;y c&agrave;ng nhiều tại c&aacute;c khu c&ocirc;ng nghiệp ở kh&ocirc;ng &iacute;t địa phương. Tuy nhi&ecirc;n, số lượng <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> n&agrave;y kh&ocirc;ng đ&aacute;p ứng đủ nhu cầu, cũng c&oacute; kh&ocirc;ng &iacute;t <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> chưa được đầu tư b&agrave;i bản, dịch vụ kh&ocirc;ng đầy đủ hoặc xa c&aacute;c thị trường ti&ecirc;u thụ lớn. &ldquo;Đầu tư x&acirc;y dựng <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> x&acirc;y sẵn để cho thu&ecirc; đ&ograve;i hỏi phải c&oacute; vốn ban đầu lớn, chưa kể thời gian thu hồi vốn rất chậm, nhanh nhất cũng đến 10 năm n&ecirc;n kh&ocirc;ng phải doanh nghiệp n&agrave;o cũng đủ tiềm lực để tham gia lĩnh vực n&agrave;y&rdquo; - &ocirc;ng Đo&agrave;n H&ugrave;ng Dũng, chủ tịch HĐQT C&ocirc;ng ty CP Kizuna JV, đơn vị vừa đầu tư khu nh&agrave; xưởng x&acirc;y sẵn đầu ti&ecirc;n tại Long An, khẳng định.</p>\r\n<p class=\"pBody\">Theo &ocirc;ng Dũng, chi ph&iacute; đầu tư hạ tầng rồi cho thu&ecirc; đất tại khu vực gi&aacute;p ranh TP.HCM hiện nay khoảng 65 USD/m<sup>2</sup>, nhưng nếu đầu tư <a href=\"http://nhaxuonggiare.com.vn/index.html\">nh&agrave; xưởng</a> chưa kể hạ tầng phải mất tới 400 USD/m<sup>2</sup>. Chẳng hạn, để x&acirc;y dựng khu nh&agrave; xưởng Kizuna 1 gồm 30 nh&agrave; xưởng với quy m&ocirc; 500-1.500m<sup>2</sup>&nbsp;(tổng cộng 24.000m<sup>2</sup>), doanh nghiệp n&agrave;y phải đầu tư hết 180 tỉ đồng. Tuy nhi&ecirc;n, &ocirc;ng Dũng khẳng định doanh nghiệp n&agrave;y sẽ tiếp tục đầu tư v&agrave;o lĩnh vực nh&agrave; xưởng x&acirc;y sẵn, dự kiến đến năm 2017 sẽ cung cấp ra thị trường một loạt nh&agrave; xưởng x&acirc;y sẵn với tổng diện t&iacute;ch l&ecirc;n đến 100.000m<sup>2</sup>. V&agrave; theo &ocirc;ng Dũng, thị trường nh&agrave; xưởng x&acirc;y sẵn c&oacute; nhiều tiềm năng do số lượng c&aacute;c doanh nghiệp nước ngo&agrave;i, nhất l&agrave; doanh nghiệp vừa v&agrave; nhỏ v&agrave;o VN ng&agrave;y c&agrave;ng nhiều, chưa kể c&aacute;c doanh nghiệp trong nước cũng c&oacute; nhu cầu về loại nh&agrave; xưởng n&agrave;y.</p>\r\n<p class=\"pBody\">Trong khi đ&oacute;, &ocirc;ng Jinjiro Kimura - tổng gi&aacute;m đốc Khu kỹ nghệ Việt Nhật - cho rằng cơ hội đầu tư v&agrave;o c&aacute;c khu nh&agrave; xưởng x&acirc;y sẵn phụ thuộc v&agrave;o t&igrave;nh h&igrave;nh thu h&uacute;t đầu tư của VN. &ldquo;Nhưng thời điểm tốt nhất để đầu tư nh&agrave; xưởng kh&ocirc;ng phải trong cao tr&agrave;o thu h&uacute;t đầu tư, v&igrave; khi đ&oacute; chủ yếu l&agrave; c&aacute;c doanh nghiệp lớn v&agrave; họ tự x&acirc;y nh&agrave; xưởng. Ch&iacute;nh thời điểm trầm lắng, c&aacute;c nh&agrave; đầu tư sẽ t&igrave;m đến nh&agrave; xưởng cho thu&ecirc; để giảm bớt rủi ro&rdquo; - &ocirc;ng Jinjiro Kimura n&oacute;i.</p>\r\n<p class=\"pBody\">Theo &ocirc;ng Kimura, thời điểm n&agrave;y l&agrave; cơ hội v&agrave;ng để đầu tư v&agrave;o lĩnh vực x&acirc;y dựng nh&agrave; xưởng n&ecirc;n doanh nghiệp n&agrave;y đang tăng tốc đầu tư, chuẩn bị sẵn sản phẩm cho giai đoạn ph&aacute;t triển &ldquo;n&oacute;ng&rdquo; của thị trường khi m&agrave; đầu tư s&ocirc;i động hơn nữa.</p>\r\n<p>&nbsp;Theo Bao Tuoi Tre</p>\r\n<hr />\r\n<p><strong><span>C&Ocirc;NG TY CỔ PHẦN CƠ KH&Iacute; X&Acirc;Y DỰNG BIỂN VIỆT</span></strong></p>\r\n<p><span>Địa chỉ: 10/42 L&ecirc; Qu&yacute; Đ&ocirc;n, KP4, P.T&acirc;n Hiệp, Tp.Bi&ecirc;n H&ograve;a, Đồng Nai</span></p>\r\n<p><span>Điện thoại: 061.3857396 Hotline: Mr H&ugrave;ng: 0904.303517; Mr Minh: 0913.797516</span></p>\r\n<p><span><span>Fax: 061.3857396&nbsp;</span><span>Email :&nbsp;</span><span class=\"gI\"><a href=\"mailto:xdbienviet@gmail.com\">xdbienviet@gmail.com</a>&nbsp; Website:&nbsp;<a href=\"http://nhaxuonggiare.com.vn/index.html\">nhaxuonggiare.com.vn</a></span></span></p>\r\n<p><span>&nbsp;</span></p>','481106795582.jpg','481106795582_710x350.jpg',1,1,'Thứ ba, 08/11/2016 11:50:03',12,'','','','','','');
