INSERT INTO `table_tinloai2_3` VALUES (36,0,'Thông tin công ty','thong-tin-cong-ty','','<div style=\"text-align: center;\"><strong><span style=\"font-size: large;\">&nbsp;</span></strong></div>\r\n<div style=\"text-align: center;\"><strong><span style=\"font-size: large;\">Bất động sản Nhật Đức Ph&aacute;t</span></strong></div>\r\n<div style=\"text-align: center;\"><strong><span style=\"font-size: large;\">&nbsp;</span></strong></div>\r\n<div>L&agrave; th&agrave;nh vi&ecirc;n thuộc Tập đo&agrave;n c&ocirc;ng nghệ h&agrave;ng đầu Việt Nam FPT, C&ocirc;ng ty Cổ phần Viễn th&ocirc;ng FPT (t&ecirc;n gọi tắt l&agrave; FPT Telecom) hiện l&agrave; một trong những nh&agrave; cung cấp dịch vụ viễn th&ocirc;ng v&agrave; Internet c&oacute; uy t&iacute;n v&agrave; được kh&aacute;ch h&agrave;ng y&ecirc;u mến tại Việt Nam v&agrave; Khu vực.<br /><br /></div>\r\n<div>Th&agrave;nh lập ng&agrave;y 31/01/1997, khởi nguồn từ Trung t&acirc;m Dịch vụ Trực tuyến do 4 th&agrave;nh vi&ecirc;n s&aacute;ng lập c&ugrave;ng sản phẩm mạng Intranet đầu ti&ecirc;n của Việt Nam mang t&ecirc;n &ldquo;Tr&iacute; tuệ Việt Nam &ndash; TTVN&rdquo;, sản phẩm được coi l&agrave; đặt nền m&oacute;ng cho sự ph&aacute;t triển của Internet tại Việt Nam. Sau gần 20 năm hoạt động, FPT Telecom đ&atilde; lớn mạnh vượt bậc với hơn 7,000 nh&acirc;n vi&ecirc;n ch&iacute;nh thức, gần 200 văn ph&ograve;ng điểm giao dịch thuộc hơn 80 chi nh&aacute;nh tại 59 tỉnh th&agrave;nh tr&ecirc;n to&agrave;n quốc. B&ecirc;n cạnh đ&oacute;, C&ocirc;ng ty đ&atilde; v&agrave; đang đặt dấu ấn tr&ecirc;n trường quốc tế bằng 8 chi nh&aacute;nh trải d&agrave;i khắp Campuchia, cũng như việc được cấp giấy ph&eacute;p kinh doanh dịch vụ tại Myanmar.<br /><br /></div>\r\n<div>Với sứ mệnh ti&ecirc;n phong đưa Internet đến với người d&acirc;n Việt Nam v&agrave; mong muốn mỗi gia đ&igrave;nh Việt Nam đều sử dụng &iacute;t nhất một dịch vụ của FPT Telecom, đồng h&agrave;nh c&ugrave;ng phương ch&acirc;m &ldquo;Kh&aacute;ch h&agrave;ng l&agrave; trọng t&acirc;m&rdquo;, ch&uacute;ng t&ocirc;i kh&ocirc;ng ngừng nỗ lực đầu tư hạ tầng, n&acirc;ng cấp chất lượng sản phẩm &ndash; dịch vụ, tăng cường ứng dụng c&ocirc;ng nghệ mới để mang đến cho kh&aacute;ch h&agrave;ng những trải nghiệm sản phẩm dịch vụ vượt trội.</div>\r\n<div><img src=\"http://fpt.vn/images/post/fpt-telecom-nhan-7-giai-thuong-sao-khue-2014.jpg\" alt=\"\" width=\"772\" height=\"512\" /></div>\r\n<div><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;FPT Telecom vinh dự nhận&nbsp;nhiều giải thưởng Sao khu&ecirc; trong c&aacute;c năm v&agrave; nhiều danh hiệu, khen thưởng kh&aacute;c<br /><br />\r\n<p><strong>LỊCH SỬ V&Agrave; C&Aacute;C MỐC PH&Aacute;T TRIỂN:</strong></p>\r\n<ul>\r\n<li>31/1/1997: Th&agrave;nh lập Trung t&acirc;m Dữ liệu trực tuyến FPT (FPT Online Exchange - FOX)</li>\r\n<li>2001: Ra mắt trang b&aacute;o điện tử đầu ti&ecirc;n tại Việt Nam - net</li>\r\n<li>2002: Trở th&agrave;nh nh&agrave; cung cấp kết nối Internet IXP ( Internet Exchange Provider)</li>\r\n<li>2005: Chuyển đổi th&agrave;nh C&ocirc;ng ty Cổ phần Viễn th&ocirc;ng FPT (FPT Telecom)</li>\r\n<li>2007: FPT Telecom bắt đầu mở rộng hoạt động tr&ecirc;n phạm vi to&agrave;n quốc, được cấp Giấy ph&eacute;p cung cấp dịch vụ viễn th&ocirc;ng li&ecirc;n tỉnh v&agrave; cổng kết nối quốc tế. Đặc biệt, FPT Telecom đ&atilde; trở th&agrave;nh th&agrave;nh vi&ecirc;n ch&iacute;nh thức của Li&ecirc;n minh AAG (Asia America Gateway - nh&oacute;m c&aacute;c c&ocirc;ng ty viễn th&ocirc;ng hai b&ecirc;n bờ Th&aacute;i B&igrave;nh Dương).</li>\r\n<li>2008: Trở th&agrave;nh nh&agrave; cung cấp dịch vụ Internet c&aacute;p quang băng rộng (FTTH) đầu ti&ecirc;n tại Việt Nam v&agrave; ch&iacute;nh thức c&oacute; đường kết nối quốc tế từ Việt Nam đi Hồng K&ocirc;ng.</li>\r\n<li>2009: Đạt mốc doanh thu 100 triệu đ&ocirc; la Mỹ v&agrave; mở rộng thị trường sang c&aacute;c nước l&acirc;n cận như Campuchia.</li>\r\n<li>2012: Ho&agrave;n thiện tuyến trục Bắc &ndash; Nam với tổng chiều d&agrave;i 4000km đi qua 30 tỉnh th&agrave;nh.</li>\r\n<li>2014: Tham gia cung cấp dịch vụ truyền h&igrave;nh IPTV với thương hiệu Truyền h&igrave;nh FPT</li>\r\n<li>2015: FPT Telecom c&oacute; mặt tr&ecirc;n cả nước với gần 200 VPGD, ch&iacute;nh thức được cấp ph&eacute;p kinh doanh tại Myanmar, đạt doanh thu hơn 5,500 tỷ đồng v&agrave; l&agrave; một trong những đơn vị dẫn đầu trong triển khai chuyển đổi giao thức li&ecirc;n mạng IPv6.</li>\r\n<li>2016: Khai trương Trung t&acirc;m Dữ liệu FPT Telecom mở rộng chuẩn Uptime TIER III với quy m&ocirc; lớn nhất miền Nam. Được cấp ph&eacute;p triển khai thử nghiệm mạng 4G taị Việt Nam.</li>\r\n</ul>\r\n<p><strong><br />C&Aacute;C SẢN PHẨM - DỊCH VỤ CH&Iacute;NH:</strong></p>\r\n<ul>\r\n<li>Cung cấp hạ tầng mạng viễn th&ocirc;ng cho dịch vụ Internet băng rộng</li>\r\n<li>Cung cấp c&aacute;c sản phẩm, dịch vụ viễn th&ocirc;ng, Internet</li>\r\n<li>Dịch vụ gi&aacute; trị gia tăng tr&ecirc;n mạng Internet, điện thoại di động</li>\r\n<li>Dịch vụ Truyền h&igrave;nh</li>\r\n<li>Dịch vụ tin nhắn, dữ liệu, th&ocirc;ng tin giải tr&iacute; tr&ecirc;n mạng điện thoại di động</li>\r\n<li>Thiết lập hạ tầng mạng v&agrave; cung cấp c&aacute;c dịch vụ viễn th&ocirc;ng, Internet</li>\r\n<li>Xuất nhập khẩu thiết bị viễn th&ocirc;ng v&agrave; Internet.</li>\r\n<li>Dịch vụ viễn th&ocirc;ng cố định nội hạt</li>\r\n<li>Dịch vụ viễn th&ocirc;ng gi&aacute; trị gia tăng</li>\r\n<li>Dịch vụ viễn th&ocirc;ng cố định đường d&agrave;i trong nước, quốc tế.</li>\r\n</ul>\r\n<p>Trong đ&oacute;,</p>\r\n<ul>\r\n<li><strong>C&aacute;c dịch vụ cho kh&aacute;ch h&agrave;ng đại ch&uacute;ng:</strong></li>\r\n<li>Dịch vụ Internet băng rộng (Internet FPT): xDSL - c&aacute;p đồng v&agrave; FTTH - c&aacute;p quang.</li>\r\n<li>Dịch vụ Truyền h&igrave;nh trả tiền (Truyền h&igrave;nh FPT): với hơn 180 k&ecirc;nh truyền h&igrave;nh, hơn 30 k&ecirc;nh HD, nội dung phong ph&uacute;, nhiều ứng dụng, sử dụng c&ocirc;ng nghệ v&agrave; tiện &iacute;ch hiện đại.</li>\r\n<li>Dịch vụ nội dung, ứng dụng tr&ecirc;n Internet: Fshare, Fsend, FPT Play, Nhacso, Mix166, StarTalk...</li>\r\n<li>Dịch vụ, sản phẩm IoT: Smart Home, Home Security HSS, FPT Play Box, Cloud Camera..</li>\r\n<li></li>\r\n<li><strong>C&aacute;c dịch vụ cho kh&aacute;ch h&agrave;ng tổ chức, doanh nghiệp:</strong></li>\r\n<li>Truyền dẫn số liệu: Trong nước (kết nối nội hạt, kết nối li&ecirc;n tỉnh) v&agrave; quốc tế (IPLC, MPLS, IEPL).</li>\r\n<li>K&ecirc;nh thu&ecirc; ri&ecirc;ng Internet: Leased Line Internet.</li>\r\n<li>Dịch vụ điện thoại: Trong nước (Điện thoại cố định, VoIP, đầu số 1800/1900) v&agrave; quốc tế.</li>\r\n<li>Dữ liệu trực tuyến: T&ecirc;n miền, lưu trữ dữ liệu v&agrave; email</li>\r\n<li>Dịch vụ quản l&yacute;: Hội nghị truyền h&igrave;nh, dịch vụ ảo h&oacute;a, t&iacute;ch hợp hệ thống, dịch vụ bảo mật.</li>\r\n<li>Dịch vụ điện to&aacute;n đ&aacute;m m&acirc;y (Cloud computing)</li>\r\n<li>Dịch vụ trung t&acirc;m dữ liệu (Data Center)</li>\r\n<li>Dịch vụ bảo mật</li>\r\n</ul>\r\n<p><strong><br />C&Aacute;C GIẢI THƯỞNG TI&Ecirc;U BIỂU</strong></p>\r\n<ul>\r\n<li>Danh hiệu Sao khu&ecirc; li&ecirc;n tiếp trong nhiều năm từ 2012 &ndash; 2015</li>\r\n<li>Huy chương V&agrave;ng ICT Việt Nam 2015</li>\r\n<li>Thương hiệu Việt ti&ecirc;u biểu 2014</li>\r\n<li>Doanh nghiệp dịch vụ được h&agrave;i l&ograve;ng nhất 2013</li>\r\n<li>Huy chương V&agrave;ng đơn vị Internet, Viễn th&ocirc;ng 2012</li>\r\n<li>Huy chương V&agrave;ng đơn vị CNTT-TT Việt Nam 2006</li>\r\n</ul>\r\n<p><strong><br />C&Aacute;C&nbsp;</strong><strong>CHỨNG CHỈ QUỐC TẾ</strong></p>\r\n<ul>\r\n<li>ISO 9001, ISO 27001, ISO 50001, Uptime TIER III</li>\r\n<li>Đối t&aacute;c V&agrave;ng (Gold Partner) Microsoft 2016</li>\r\n<li>Đối t&aacute;c V&agrave;ng (Gold Partner) CISCO 2015</li>\r\n<li>CCIE, JNCIE, CDCP, CISSP...</li>\r\n</ul>\r\n<p><strong><br />LI&Ecirc;N HỆ:</strong></p>\r\n<p><strong>H&agrave; Nội:</strong>&nbsp;T&ograve;a nh&agrave; PVI, số 1 Phạm Văn Bạch, Cầu Giấy | Tel: (84-4) 7300 2222 | Fax: (84-4) 7300 8889<br /><strong>HCM:</strong>&nbsp;L&ocirc; 37-39A, đường 19, KCX T&acirc;n Thuận, Phường T&acirc;n Thuận Đ&ocirc;ng, Quận 7 | Tel: (84-8) 7300 2222 | Fax: (84-8)7300 8889<br /><strong>Đ&agrave; Nẵng:</strong>&nbsp;182 - 184 Đường 2 th&aacute;ng 9, Hải Ch&acirc;u | Tel:(84-511) 7300 2222 | Fax: (84-511) 3899 889</p>\r\n<p><br />Tổng đ&agrave;i Chăm s&oacute;c kh&aacute;ch h&agrave;ng 24/7: 1900 6600</p>\r\n<p>HiFPT - Ứng dụng Chăm s&oacute;c kh&aacute;ch h&agrave;ng 24/7:&nbsp;<a href=\"https://hi.fpt.vn/\">https://hi.fpt.vn/</a></p>\r\n<p>H&ograve;m thư Hỗ trợ kh&aacute;ch h&agrave;ng:&nbsp;<a href=\"mailto:hotrokhachhang@fpt.com.vn\">hotrokhachhang@fpt.vn</a></p>\r\n<p>Website ch&iacute;nh thức:&nbsp;&nbsp;<a href=\"http://www.fpt.vn/\">www.fpt.vn</a></p>\r\n<p>Facebook ch&iacute;nh thức:&nbsp;<a href=\"https://www.facebook.com/FptTelecom/?fref=ts\">www.facebook.com/FptTelecom</a>&nbsp;</p>\r\n</div>','','',1,1,0,'','','','','','',''),(37,0,'Lịch sử phát triển','lich-su-phat-trien','','<p>lspt</p>','','',1,1,0,'','','','','','','');
