INSERT INTO `table_tinloai3_1` VALUES (4,'Welcome Spa Cam Ranh','','<p>Đơn gi&aacute; tr&ecirc;n l&agrave; đơn gi&aacute; trọn g&oacute;i từ thiết kế, thi c&ocirc;ng ho&agrave;n thiện to&agrave;n bộ c&ocirc;ng tr&igrave;nh (chưa bao gồm 10% VAT).</p>\r\n<p>- M&oacute;ng đơn BTCT t&iacute;nh to&aacute;n ph&ugrave; hợp với cường độ đất nền tại vị tr&iacute; x&acirc;y dựng</p>\r\n<p>- Tường gạch bao che d&agrave;y 200, cao 2 &gt; 2.5m, t&ocirc; tr&aacute;t, sơn nước ho&agrave;n thiện. B&ecirc;n tr&ecirc;n tường l&agrave; v&aacute;ch t&ocirc;n đến đỉnh cột</p>\r\n<p>- Nền c&oacute; cấu tạo: Đ&aacute; 0x4 d&agrave;y 200, b&ecirc; t&ocirc;ng M200 d&agrave;y 100, lưới th&eacute;p h&agrave;n&nbsp;<a href=\"mailto:D6@200x200\">D6@200x200</a></p>\r\n<p>- Khung k&egrave;o th&eacute;p dạng Zamil t&iacute;nh to&aacute;n bằng phần mềm chuy&ecirc;n dụng Tekla&nbsp;structures&nbsp;V17</p>\r\n<p>- X&agrave; gồ, t&ocirc;n m&aacute;i, t&ocirc;n v&aacute;ch v&agrave; phụ kiện đồng bộ của Hoa Sen</p>\r\n<p>- To&agrave;n bộ bulon neo l&agrave; bulon cường độ cao cấp độ bền 8.8 nhập khẩu (bao test Trung t&acirc;m 3)</p>\r\n<p>Kh&aacute;ch h&agrave;ng quan t&acirc;m ch&uacute;ng t&ocirc;i sẽ đưa đi tham quan c&aacute;c c&ocirc;ng tr&igrave;nh ch&uacute;ng t&ocirc;i đ&atilde; thực hiện đạt y&ecirc;u cầu cao về kỹ thuật, mỹ thuật.</p>\r\n<hr />\r\n<p><strong>C&Ocirc;NG TY CỔ PHẦN CƠ KH&Iacute; X&Acirc;Y DỰNG BIỂN VIỆT</strong></p>\r\n<p><span>Địa chỉ: 10/42 L&ecirc; Qu&yacute; Đ&ocirc;n, KP4, P.T&acirc;n Hiệp, Tp.Bi&ecirc;n H&ograve;a, Đồng Nai</span></p>\r\n<p><span>Điện thoại: 061.3857396 Hotline: Mr H&ugrave;ng: 0904.303517; Mr Minh: 0913.797516</span></p>\r\n<p><span><span>Fax: 061.3857396&nbsp;</span><span>Email : info</span><span class=\"gI\"><a href=\"mailto:xdbienviet@gmail.com\">@bienviet.com.vn</a>&nbsp;Website:&nbsp;<a href=\"http://nhaxuonggiare.com.vn/index.html\">nhaxuonggiare.com.vn</a></span></span></p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><span>&nbsp;</span><span style=\"line-he