INSERT INTO `table_tinloai3_3` VALUES (4,'Welcome Spa Cam Ranh','','<form class=\"form-inline\" action=\"http://thietkenhaxuong.net.vn/#\">\r\n<div class=\"cal-panel panel panel-danger\">\r\n<div class=\"panel-body\">\r\n<div class=\"col-md-3 no-padding\">&nbsp;<span style=\"text-decoration: underline; line-height: 1.5;\">Nội dung hồ sơ thiết kế :</span></div>\r\n</div>\r\n</div>\r\n</form>\r\n<div id=\"cal_detail\">\r\n<div class=\"table-responsive\">\r\n<div>\r\n<p>1. Mặt bằng tổng thể, mặt đứng, mặt cắt c&ocirc;ng tr&igrave;nh, phối cảnh c&ocirc;ng tr&igrave;nh</p>\r\n<p>2. Bản vẽ kết cấu, thuyết minh t&iacute;nh to&aacute;n kết cấu (t&iacute;nh to&aacute;n bằng Sap 2000 kết hợp Tekla)</p>\r\n<p>3 .Bản vẽ hệ thống điện, ph&ograve;ng ch&aacute;y chữa ch&aacute;y, hệ thống cấp tho&aacute;t nước.</p>\r\n<p>4. Bản vẽ s&acirc;n đường nội bộ.</p>\r\n<p>5. Lập dự to&aacute;n chi ph&iacute;</p>\r\n<p>6. Hỗ trợ lập Hố sơ xin ph&eacute;p x&acirc;y dựng.</p>\r\n<div><span><span style=\"text-decoration: underline;\">Quy tr&igrave;nh nhận hồ sơ thiết kế :</span></span></div>\r\n<div><br />1. Gặp chủ đầu tư, trao đổi &yacute; tưởng v&agrave; nắm bắt c&aacute;c nhu cầu của chủ đầu tư.</div>\r\n<p>2. Khảo s&aacute;t mặt bằng hiện trạng</p>\r\n<p>3. Thiết kế sơ bộ 02 phương &aacute;n</p>\r\n<p>4. Thiết kế chi tiết phương &aacute;n chọn</p>\r\n<br /><span><span><span>ĐƠN GI&Aacute; X&Acirc;Y DỰNG NH&Agrave; XƯỞNG:</span></span></span></div>\r\n<p><span style=\"line-height: 1.5;\">- Nh&agrave; xưởng khung k&egrave;o th&eacute;p tiền chế gi&aacute; chỉ từ:&nbsp;</span><span style=\"line-height: 1.5;\">1,100,000đ/m2 - 2,400,000đ/m2.&nbsp;</span><span style=\"line-height: 1.5;\">Gi&aacute; trọn g&oacute;i bao gồm: Khảo s&aacute;t, thiết kế, thi c&ocirc;ng lắp dựng ho&agrave;n thiện (chưa bao gồm 10% VAT).</span></p>\r\n<p><span style=\"line-height: 1.5;\">- Đơn gi&aacute; c&oacute; thể thay đổi khi diện t&iacute;ch nhỏ hơn 2.000m2, m&oacute;ng cọc...&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"table-responsive\">\r\n<h2 class=\"text-success\"><span>GI&Aacute; THI C&Ocirc;NG M&Oacute;NG CỌC:</span></h2>\r\n<table class=\"table table-borderd\">\r\n<thead>\r\n<tr><th>STT</th><th>Hạng mục c&ocirc;ng việc</th><th>Khối lượng tối thiểu</th><th>Đơn gi&aacute;</th><th>Chủng loại vật tư</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>1</td>\r\n<td>M&oacute;ng cọc D250 b&ecirc; t&ocirc;ng cốt th&eacute;p</td>\r\n<td>150 m</td>\r\n<td>320,400 vnđ</td>\r\n<td>th&eacute;p vinakyoei</td>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td>Đ&oacute;ng cọc tr&agrave;m chiều d&agrave;i 4m, D8 - 10</td>\r\n<td>100 cay</td>\r\n<td>30,000 vnđ</td>\r\n<td>Cọc tr&agrave;m loại 1, đủ ĐK</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>Ph&aacute; dỡ b&ecirc; t&ocirc;ng đầu cọc</td>\r\n<td>30 cai</td>\r\n<td>65,000 vnđ</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td>Đ&agrave;o đất nền thủ c&ocirc;ng</td>\r\n<td>15 m</td>\r\n<td>68,250 vnđ</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>5</td>\r\n<td>Đ&agrave;o đất bằng cơ giới</td>\r\n<td>500 m3</td>\r\n<td>12,600 vnđ</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>6</td>\r\n<td>Đắp đất nền thủ c&ocirc;ng</td>\r\n<td>15 m3</td>\r\n<td>52,500 vnđ</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><strong><span>C&Ocirc;NG TY CỔ PHẦN CƠ KH&Iacute; X&Acirc;Y DỰNG BIỂN VIỆT</span></strong></p>\r\n<p><span>Địa chỉ: 10/42 L&ecirc; Qu&yacute; Đ&ocirc;n, KP4, P.T&acirc;n Hiệp, Tp.Bi&ecirc;n H&ograve;a, Đồng Nai</span></p>\r\n<p><span>Điện thoại: 061.3857396 Hotline: Mr H&ugrave;ng: 0904.303517; Mr Minh: 0913.797516</span></p>\r\n<p><span><span>Fax: 061.3857396&nbsp;</span><span>Email: info@bienviet.com.vn&nbsp;</span><span class=\"gI\">&nbsp; Website:&nbsp;<a href=\"http://nhaxuonggiare.com.vn/index.html\">nhaxuonggiare.vn</a></span></span></p>\r\n<h2><span><span><span>&nbsp;</span></span></span></h2>\r\n</div>\r\n</div>\r\n</div>','57083.jpg','',